INSERT INTO `ost_canned_response` (`canned_id`, `dept_id`, `isenabled`, `title`, `response`, `lang`, `notes`, `created`, `updated`) VALUES
(1, 0, 1, 'What is osTicket (sample)?', 'osTicket is a widely-used open source support ticket system, an\nattractive alternative to higher-cost and complex customer support\nsystems - simple, lightweight, reliable, open source, web-based and easy\nto setup and use.', 'en_US', NULL, '2017-06-13 15:13:19', '2017-06-13 15:13:19'),
(2, 0, 1, 'Sample (with variables)', 'Hi %{ticket.name.first},\n<br>\n<br>\nYour ticket #%{ticket.number} created on %{ticket.create_date} is in\n%{ticket.dept.name} department.', 'en_US', NULL, '2017-06-13 15:13:20', '2017-06-13 15:13:20'),
(3, 0, 1, 'Permintaan Pengisian Formulir', 'Yth %{ticket.name}<br /><br />Terkait permintaan Bapak/Ibu dengan nomor tiket %{ticket.number} , mohon kesediaan Bapak/Ibu untuk mengisi formulir terlampir. Jika sudah diisi, mohon dikirimkan kembali kepada kami melalui tiket ini untuk kami tindaklanjuti.<br /><br />Terimakasih', 'en_US', NULL, '2018-01-11 09:24:44', '2018-01-11 09:24:44'),
(4, 0, 1, 'Email Lockout', 'Yth. Bpk/Ibu %{ticket.name}<br /><br />Permasalahan telah kami tindaklanjuti, kemungkinan yang bersangkutan salah memasukkan password lebih dari 5 kali sehingga akun email \"terkunci sementara/lockout\" dan otomatis akan aktif kembali 30 menit kemudian.<br />Mohon diperiksa juga settingan email paka smartphone apakah sudah menggunakan password ya benar. Apabila masih menggunakan password yang salah, smartphone akan mereload email dengan password yang lama terus menerus dan mengakibatkan email terkunci kembali.<br /><br />Status email yang bersangkutan saat ini \"active\", silahkan dicoba login kembali.<br />Jika dirasa perlu melakukan penggantian password email, silahkan reply pada ticket ini agar dapat kami berikan password baru.<br /><br />Terimakasih.', 'en_US', NULL, '2018-02-02 14:59:03', '2018-04-12 10:38:45'),
(5, 0, 1, 'Reset Password Pribadi', 'Yth. Bpk/Ibu %{ticket.name}<br /><br />Permintaan telah kami tindaklanjuti, silahkan ikuti langkah berikut:<br />1. Akses mail.bps.go.id dan login ke account email masing-masing<br />2. Gunakan NIP lama (9 digit) pegawai yang bersangkutan sebagai password sementara untuk login email.<br />3. Selanjutnya akan diminta mengisi password baru saat pertama kali login.<br />4. Masukkan password baru yang diinginkan (minimal 6 karakter).<br /><br />NB:<br />Jika email diakses melalui smartphone, mohon untuk settingan password juga diganti.<br />Hal tersebut dikarenakan smartphone akan mereload terus-menerus menggunakan password lama, sehingga account akan terkunci*. Mohon dapat diinformasikan pula bagi pengguna email tersebut untuk menggunakan password baru dikarenakan jika salah memasukkan password hingga 5 kali, maka account juga akan terkunci*.<br /><br />*)Jika account terkunci maka harus menunggu 30 menit kemudian untuk dapat diakses kembali.<br /><br />Terimakasih.', 'en_US', NULL, '2018-02-05 08:05:35', '2018-03-06 11:49:36'),
(6, 0, 1, 'Closed Email Spam', 'Yth. Bpk/Ibu %{ticket.name}<br /><br />Email tersebut sementara kami closed/tutup sementara dikarenakan beberapa hari yang lalu menyebarkan email spam sehingga menyebabkan traffic email terganggu. Kemungkinan hal tersebut dikarenakan email terinject virus.<br /><br />Mohon agar dapat melakukan instalasi/update antivirus pada PC/perangkat yang digunakan.<br />Jika ada setting email melalui smartphone, mohon agar dapat melakukan logout terlebih dahulu dari akun email, dan selanjutnya melakukan instalasi/update antivirus pada smartphone tersebut.<br /><br />Dan mohon agar menginformasikan kembali kepada kami sehingga email dapat kami aktifkan kembali dengan menggunakan password baru.<br /><br />Terima kasih.', 'en_US', NULL, '2018-02-05 08:06:37', '2018-03-06 11:50:19'),
(7, 0, 1, 'Tidak bisa VPN', 'Yth. Bpk/Ibu %{ticket.name}<br /><br /> Mohon ybs agar login ke community.bps.go.id terlebih dahulu.<br /> Lalu tunggu selama 15 menit, kemudian login kembali ke VPN via Sonicwall Mobile.<br /><br /> Terima kasih. ', 'en_US', NULL, '2018-02-12 14:10:55', '2018-02-12 14:10:55'),
(8, 5, 1, 'tanya koneksi', ' Bpk/Ibu %{ticket.name} Ysh.<br />Koneksi apa yang digunakan untuk akses ke portalpublikasi.bps.go.id?<br />Terkoneksi dengan sonicwall mobile connect atau dengan sonicwall yang hardware kah?<br />Terima Kasih', 'en_US', NULL, '2018-02-13 09:00:37', '2018-02-13 09:00:37'),
(9, 0, 1, 'Reset Password Unit Kerja', 'Yth Bp/Ibu %{ticket.name}<br /><br />Password sementara :<br /><br />Permintaan telah kami tindaklanjuti, silahkan ikuti langkah berikut:<br />1. Akses mail.bps.go.id dan login ke account email <br />2. Gunakan password sementara untuk login email.<br />3. Selanjutnya akan diminta mengisi password baru saat pertama kali login.<br />4. Masukkan password baru yang diinginkan (minimal 6 karakter).<br /><br />NB:<br />Jika email diakses melalui smartphone, mohon untuk settingan password juga diganti.<br />Hal tersebut dikarenakan smartphone akan mereload terus-menerus menggunakan password lama, sehingga account akan terkunci*. Mohon dapat diinformasikan pula bagi pengguna email tersebut untuk menggunakan password baru dikarenakan jika salah memasukkan password hingga 5 kali, maka account juga akan terkunci*.<br /><br />*)Jika account terkunci maka harus menunggu 30 menit kemudian untuk dapat diakses kembali.<br /><br />Terimakasih.', 'en_US', NULL, '2018-03-06 11:43:37', '2018-03-06 11:47:20'),
(10, 0, 1, 'Penamaan Email BPS', 'Yth. Bpk/Ibu %{ticket.name}<br /><br />Mohon maaf permintaan belum dapat kami penuhi.<br />Berikut ini adalah standar ketentuan penamaan Email BPS:<br /><br />1. Nama tunggal<br /> nama@bps.go.id<br /> Contoh: Miswar akan memiliki alamat email miswar@bps.go.id<br />2. Nama dengan dua suku kata<br /> sukukatapertama.sukukatakedua@bps.go.id<br /> Contoh: Siska Ambarwati akan memiliki alamat email siska.ambarwati@bps.go.id<br />3. Nama duplikat<br /> sukukatapertama.sukukatakedua(n)@bps.go.id. dimana n menyatakan nomor yang belum digunakan.<br /> Contoh: Siska Ambarwati yang kedua akan memiliki alamat email siska.ambarwati2@bps.go.id<br />4. Nama dengan spasi<br /> Spasi akan dihilangkan dan nama akan digabungkan. Ini akan dilakukan baik pada nama depan maupun nama belakang.<br /> Contoh: Hery Al Amin akan memiliki alamat email hery.alamin@bps.go.id<br />5. Nama dengan apostrof (tanda petik) atau tanda baca yang lain<br /> Apostrof atau tanda baca yang lain akan dihilangkan<br /> Contoh: Sadiyah akan memiliki alamat email sadiyah@bps.go.id<br />6. Nama dengan lebih dari dua suku kata<br /> Sukukatapertama.sukukatakedua@bps.go.id atau sukukatapertama.sukukataterakhir@bps.go.id<br /> Contoh: Ahmad Hartiono Utomo akan memiliki email ahmad.hartiono@bps.go.id atau ahmad.utomo@bps.go.id bila<br /> email pertama sudah terpakai<br />7. Nama dengan gelar<br /> Gelar dihilangkan dan hanya digunakan nama resminya<br /> Contoh: Dr. Indria Sasmita akan memiliki email indria.sasmita@bps.go.id<br /> RA. Asih Sulistiowati akan memiliki email asih.sulistiowati@bps.go.id<br />9. Nama Panggilan<br /> Nama panggilan tidak lagi diperkenankan sebagai alamat email', 'en_US', NULL, '2018-03-14 12:05:28', '2018-03-14 12:08:23'),
(12, 6, 1, 'Perawatan Perangkat Keras Pusat', 'Yth. Bpk/Ibu %{ticket.name}<br />Mengenai permasalahan pada perangkat keras tersebut masuk dalam perawatan, sementara masih menunggu perawatan yang belum dimulai unit dapat sementara disimpan terlebih dahulu, untuk permasalahan ini kami pending dan akan kami kabari saat perawatan sudah dimulai via email bronzegd.pusat@bps.go.id dan metalgd.pusat@bps.go.id. <br /><br />Terima kasih telah menghubungi HaloSIS. <br />salam', 'en_US', '<br />', '2018-04-05 16:36:28', '2018-04-05 17:05:23'),
(13, 0, 1, 'Aktivasi Ms. Office 2010 & 2013', 'Yth. Bpk/Ibu %{ticket.name}<br />Untuk aktivasi Office dapat di unduh di community: <a href=\"https://community.bps.go.id/portal/files/panduan%20aktivasi%20office.pdf\">https://community.bps.go.id/portal/files/panduan aktivasi office.pdf.</a><br /><br />Terima kasih telah menghubungi HaloSIS<br />Salam.', 'en_US', '<br />', '2018-04-05 17:02:01', '2018-04-05 17:04:55');
