INSERT INTO `ost_email_template` (`id`, `tpl_id`, `code_name`, `subject`, `body`, `notes`, `created`, `updated`) VALUES
(1, 1, 'ticket.autoresp', 'Support Ticket Opened [#%{ticket.number}]', '<h3><strong>Dear %{recipient.name.first},</strong></h3> <p> A request for support has been created and assigned #%{ticket.number}. A representative will follow-up with you as soon as possible. You can <a href=\"%%7Brecipient.ticket_link%7D\">view this ticket\'s progress online</a>. </p> <br /><div style=\"color:rgb(127, 127, 127)\"> Your %{company.name} Team, <br /> %{signature} </div> <hr /> <div style=\"color:rgb(127, 127, 127);font-size:small\"><em>If you wish to provide additional comments or information regarding the issue, please reply to this email or <a href=\"%%7Brecipient.ticket_link%7D\"><span style=\"color:rgb(84, 141, 212)\">login to your account</span></a> for a complete archive of your support requests.</em></div> ', NULL, '2017-06-13 15:13:21', '2017-06-13 15:13:21'),
(2, 1, 'ticket.autoreply', 'Re: %{ticket.subject} [#%{ticket.number}]', ' <h3><strong>Dear %{recipient.name.first},</strong></h3> A request for support has been created and assigned ticket <a href=\"%%7Brecipient.ticket_link%7D\">#%{ticket.number}</a> with the following automatic reply <br /><br /> Topic: <strong>%{ticket.topic.name}</strong> <br /> Subject: <strong>%{ticket.subject}</strong> <br /><br /> %{response} <br /><br /><div style=\"color:rgb(127, 127, 127)\">Your %{company.name} Team,<br /> %{signature}</div> <hr /> <div style=\"color:rgb(127, 127, 127);font-size:small\"><em>We hope this response has sufficiently answered your questions. If you wish to provide additional comments or informatione, please reply to this email or <a href=\"%%7Brecipient.ticket_link%7D\"><span style=\"color:rgb(84, 141, 212)\">login to your account</span></a> for a complete archive of your support requests.</em></div> ', NULL, '2017-06-13 15:13:21', '2017-06-13 15:13:21'),
(3, 1, 'message.autoresp', 'Message Confirmation', ' <h3><strong>Dear %{recipient.name.first},</strong></h3> Your reply to support request <a href=\"%%7Brecipient.ticket_link%7D\">#%{ticket.number}</a> has been noted <br /><br /><div style=\"color:rgb(127, 127, 127)\"> Your %{company.name} Team,<br /> %{signature} </div> <hr /> <div style=\"color:rgb(127, 127, 127);font-size:small;text-align:center\"> <em>You can view the support request progress <a href=\"%%7Brecipient.ticket_link%7D\">online here</a></em> </div> ', NULL, '2017-06-13 15:13:21', '2017-06-13 15:13:21'),
(4, 1, 'ticket.notice', '%{ticket.subject} [#%{ticket.number}]', ' <h3><strong>Dear %{recipient.name.first},</strong></h3> Our customer care team has created a ticket, <a href=\"%%7Brecipient.ticket_link%7D\">#%{ticket.number}</a> on your behalf, with the following details and summary: <br /><br /> Topic: <strong>%{ticket.topic.name}</strong> <br /> Subject: <strong>%{ticket.subject}</strong> <br /><br /> %{message} <br /><br /> If need be, a representative will follow-up with you as soon as possible. You can also <a href=\"%%7Brecipient.ticket_link%7D\">view this ticket\'s progress online</a>. <br /><br /><div style=\"color:rgb(127, 127, 127)\"> Your %{company.name} Team,<br /> %{signature}</div> <hr /> <div style=\"color:rgb(127, 127, 127);font-size:small\"><em>If you wish to provide additional comments or information regarding the issue, please reply to this email or <a href=\"%%7Brecipient.ticket_link%7D\"><span style=\"color:rgb(84, 141, 212)\">login to your account</span></a> for a complete archive of your support requests.</em></div> ', NULL, '2017-06-13 15:13:21', '2017-06-13 15:13:21'),
(5, 1, 'ticket.overlimit', 'Open Tickets Limit Reached', ' <h3><strong>Dear %{ticket.name.first},</strong></h3> You have reached the maximum number of open tickets allowed. To be able to open another ticket, one of your pending tickets must be closed. To update or add comments to an open ticket simply <a href=\"%%7Burl%7D/tickets.php?e=%%7Bticket.email%7D\">login to our helpdesk</a>. <br /><br /> Thank you,<br /> Support Ticket System', NULL, '2017-06-13 15:13:21', '2017-06-13 15:13:21'),
(6, 1, 'ticket.reply', 'Re: %{ticket.subject} [#%{ticket.number}]', ' <h3><strong>Dear %{recipient.name},</strong></h3> %{response} <br /><br /><div style=\"color:rgb(127, 127, 127)\"> Your %{company.name} Team,<br /> %{signature} </div> <hr /> <div style=\"color:rgb(127, 127, 127);font-size:small;text-align:center\"><em>We hope this response has sufficiently answered your questions. If not, please do not send another email. Instead, reply to this email or <a href=\"%%7Brecipient.ticket_link%7D\" style=\"color:rgb(84, 141, 212)\">login to your account</a> for a complete archive of all your support requests and responses.</em></div> ', NULL, '2017-06-13 15:13:22', '2017-06-13 15:13:22'),
(7, 1, 'ticket.activity.notice', 'Re: %{ticket.subject} [#%{ticket.number}]', ' <h3><strong>Dear %{recipient.name.first},</strong></h3> <div> <em>%{poster.name}</em> just logged a message to a ticket in which you participate. </div> <br /> %{message} <br /><br /><hr /> <div style=\"color:rgb(127, 127, 127);font-size:small;text-align:center\"> <em>You\'re getting this email because you are a collaborator on ticket <a href=\"%%7Brecipient.ticket_link%7D\" style=\"color:rgb(84, 141, 212)\">#%{ticket.number}</a>. To participate, simply reply to this email or <a href=\"%%7Brecipient.ticket_link%7D\" style=\"color:rgb(84, 141, 212)\">click here</a> for a complete archive of the ticket thread.</em> </div> ', NULL, '2017-06-13 15:13:22', '2017-06-13 15:13:22'),
(8, 1, 'ticket.alert', 'New Ticket Alert', ' <h2>Hi %{recipient.name},</h2> New ticket #%{ticket.number} created <br /><br /><table><tbody> <tr> <td> <strong>From</strong>: </td> <td> %{ticket.name} </td> </tr> <tr> <td> <strong>Department</strong>: </td> <td> %{ticket.dept.name} </td> </tr> </tbody></table> <br /> %{message} <br /><br /><hr /> <div>To view or respond to the ticket, please <a href=\"%%7Bticket.staff_link%7D\">login</a> to the support ticket system</div> <em style=\"font-size:small\">Your friendly Customer Support System</em> <br /><a href=\"http://osticket.com/\"><img width=\"126\" height=\"19\" style=\"width:126px\" alt=\"Powered By osTicket\" src=\"cid:b56944cb4722cc5cda9d1e23a3ea7fbc\" /></a> ', NULL, '2017-06-13 15:13:22', '2017-06-13 15:13:22'),
(9, 1, 'message.alert', 'New Message Alert', ' <h3><strong>Hi %{recipient.name},</strong></h3> New message appended to ticket <a href=\"%%7Bticket.staff_link%7D\">#%{ticket.number}</a> <br /><br /><table><tbody> <tr> <td> <strong>From</strong>: </td> <td> %{ticket.name} </td> </tr> <tr> <td> <strong>Department</strong>: </td> <td> %{ticket.dept.name} </td> </tr> </tbody></table> <br /> %{message} <br /><br /><hr /> <div>To view or respond to the ticket, please <a href=\"%%7Bticket.staff_link%7D\"><span style=\"color:rgb(84, 141, 212)\">login</span></a> to the support ticket system</div> <em style=\"color:rgb(127,127,127);font-size:small\">Your friendly Customer Support System</em><br /><img src=\"cid:b56944cb4722cc5cda9d1e23a3ea7fbc\" alt=\"Powered by osTicket\" width=\"126\" height=\"19\" style=\"width:126px\" /> ', NULL, '2017-06-13 15:13:22', '2017-06-13 15:13:22'),
(10, 1, 'note.alert', 'New Internal Activity Alert', ' <h3><strong>Hi %{recipient.name},</strong></h3> An agent has logged activity on ticket <a href=\"%%7Bticket.staff_link%7D\">#%{ticket.number}</a> <br /><br /><table><tbody> <tr> <td> <strong>From</strong>: </td> <td> %{note.poster} </td> </tr> <tr> <td> <strong>Title</strong>: </td> <td> %{note.title} </td> </tr> </tbody></table> <br /> %{note.message} <br /><br /><hr /> To view/respond to the ticket, please <a href=\"%%7Bticket.staff_link%7D\">login</a> to the support ticket system <br /><br /><em style=\"font-size:small\">Your friendly Customer Support System</em> <br /><img src=\"cid:b56944cb4722cc5cda9d1e23a3ea7fbc\" alt=\"Powered by osTicket\" width=\"126\" height=\"19\" style=\"width:126px\" /> ', NULL, '2017-06-13 15:13:22', '2017-06-13 15:13:22'),
(11, 1, 'assigned.alert', 'Ticket Assigned to you', ' <h3><strong>Hi %{assignee.name.first},</strong></h3> Ticket <a href=\"%%7Bticket.staff_link%7D\">#%{ticket.number}</a> has been assigned to you by %{assigner.name.short} <br /><br /><table><tbody> <tr> <td> <strong>From</strong>: </td> <td> %{ticket.name} </td> </tr> <tr> <td> <strong>Subject</strong>: </td> <td> %{ticket.subject} </td> </tr> </tbody></table> <br /> %{comments} <br /><br /><hr /> <div>To view/respond to the ticket, please <a href=\"%%7Bticket.staff_link%7D\"><span style=\"color:rgb(84, 141, 212)\">login</span></a> to the support ticket system</div> <em style=\"font-size:small\">Your friendly Customer Support System</em> <br /><img src=\"cid:b56944cb4722cc5cda9d1e23a3ea7fbc\" alt=\"Powered by osTicket\" width=\"126\" height=\"19\" style=\"width:126px\" /> ', NULL, '2017-06-13 15:13:22', '2017-06-13 15:13:22'),
(12, 1, 'transfer.alert', 'Ticket #%{ticket.number} transfer - %{ticket.dept.name}', ' <h3>Hi %{recipient.name},</h3> Ticket <a href=\"%%7Bticket.staff_link%7D\">#%{ticket.number}</a> has been transferred to the %{ticket.dept.name} department by <strong>%{staff.name.short}</strong> <br /><br /><blockquote> %{comments} </blockquote> <hr /> <div>To view or respond to the ticket, please <a href=\"%%7Bticket.staff_link%7D\">login</a> to the support ticket system. </div> <em style=\"font-size:small\">Your friendly Customer Support System</em> <br /><a href=\"http://osticket.com/\"><img width=\"126\" height=\"19\" alt=\"Powered By osTicket\" style=\"width:126px\" src=\"cid:b56944cb4722cc5cda9d1e23a3ea7fbc\" /></a> ', NULL, '2017-06-13 15:13:22', '2017-06-13 15:13:22'),
(13, 1, 'ticket.overdue', 'Stale Ticket Alert', ' <h3> <strong>Hi %{recipient.name}</strong>,</h3> A ticket, <a href=\"%%7Bticket.staff_link%7D\">#%{ticket.number}</a> is seriously overdue. <br /><br /> We should all work hard to guarantee that all tickets are being addressed in a timely manner. <br /><br /> Signed,<br /> %{ticket.dept.manager.name} <hr /> <div>To view or respond to the ticket, please <a href=\"%%7Bticket.staff_link%7D\"><span style=\"color:rgb(84, 141, 212)\">login</span></a> to the support ticket system. You\'re receiving this notice because the ticket is assigned directly to you or to a team or department of which you\'re a member.</div> <em style=\"font-size:small\">Your friendly <span style=\"font-size:smaller\">(although with limited patience)</span> Customer Support System</em><br /><img src=\"cid:b56944cb4722cc5cda9d1e23a3ea7fbc\" height=\"19\" alt=\"Powered by osTicket\" width=\"126\" style=\"width:126px\" /> ', NULL, '2017-06-13 15:13:22', '2017-06-13 15:13:22'),
(14, 1, 'task.alert', 'New Task Alert', ' <h2>Hi %{recipient.name},</h2> New task <a href=\"%%7Btask.staff_link%7D\">#%{task.number}</a> created <br /><br /><table><tbody><tr> <td> <strong>Department</strong>: </td> <td> %{task.dept.name} </td> </tr></tbody></table> <br /> %{task.description} <br /><br /><hr /> <div>To view or respond to the ticket, please <a href=\"%%7Btask.staff_link%7D\">login</a> to the support system</div> <em style=\"font-size:small\">Your friendly Customer Support System</em> <br /><a href=\"http://osticket.com/\"><img width=\"126\" height=\"19\" style=\"width:126px\" alt=\"Powered By osTicket\" src=\"cid:b56944cb4722cc5cda9d1e23a3ea7fbc\" /></a> ', NULL, '2017-06-13 15:13:23', '2017-06-13 15:13:23'),
(15, 1, 'task.activity.notice', 'Re: %{task.title} [#%{task.number}]', ' <h3><strong>Dear %{recipient.name.first},</strong></h3> <div> <em>%{poster.name}</em> just logged a message to a task in which you participate. </div> <br /> %{message} <br /><br /><hr /> <div style=\"color:rgb(127, 127, 127);font-size:small;text-align:center\"> <em>You\'re getting this email because you are a collaborator on task #%{task.number}. To participate, simply reply to this email.</em> </div> ', NULL, '2017-06-13 15:13:23', '2017-06-13 15:13:23'),
(16, 1, 'task.activity.alert', 'Task Activity [#%{task.number}] - %{activity.title}', ' <h3><strong>Hi %{recipient.name},</strong></h3> Task <a href=\"%%7Btask.staff_link%7D\">#%{task.number}</a> updated: %{activity.description} <br /><br /> %{message} <br /><br /><hr /> <div>To view or respond to the task, please <a href=\"%%7Btask.staff_link%7D\"><span style=\"color:rgb(84, 141, 212)\">login</span></a> to the support system</div> <em style=\"color:rgb(127,127,127);font-size:small\">Your friendly Customer Support System</em><br /><img src=\"cid:b56944cb4722cc5cda9d1e23a3ea7fbc\" alt=\"Powered by osTicket\" width=\"126\" height=\"19\" style=\"width:126px\" /> ', NULL, '2017-06-13 15:13:23', '2017-06-13 15:13:23'),
(17, 1, 'task.assignment.alert', 'Task Assigned to you', ' <h3><strong>Hi %{assignee.name.first},</strong></h3> Task <a href=\"%%7Btask.staff_link%7D\">#%{task.number}</a> has been assigned to you by %{assigner.name.short} <br /><br /> %{comments} <br /><br /><hr /> <div>To view/respond to the task, please <a href=\"%%7Btask.staff_link%7D\"><span style=\"color:rgb(84, 141, 212)\">login</span></a> to the support system</div> <em style=\"font-size:small\">Your friendly Customer Support System</em> <br /><img src=\"cid:b56944cb4722cc5cda9d1e23a3ea7fbc\" alt=\"Powered by osTicket\" width=\"126\" height=\"19\" style=\"width:126px\" /> ', NULL, '2017-06-13 15:13:23', '2017-06-13 15:13:23'),
(18, 1, 'task.transfer.alert', 'Task #%{task.number} transfer - %{task.dept.name}', ' <h3>Hi %{recipient.name},</h3> Task <a href=\"%%7Btask.staff_link%7D\">#%{task.number}</a> has been transferred to the %{task.dept.name} department by <strong>%{staff.name.short}</strong> <br /><br /><blockquote> %{comments} </blockquote> <hr /> <div>To view or respond to the task, please <a href=\"%%7Btask.staff_link%7D\">login</a> to the support system. </div> <em style=\"font-size:small\">Your friendly Customer Support System</em> <br /><a href=\"http://osticket.com/\"><img width=\"126\" height=\"19\" alt=\"Powered By osTicket\" style=\"width:126px\" src=\"cid:b56944cb4722cc5cda9d1e23a3ea7fbc\" /></a> ', NULL, '2017-06-13 15:13:23', '2017-06-13 15:13:23'),
(19, 1, 'task.overdue.alert', 'Stale Task Alert', ' <h3> <strong>Hi %{recipient.name}</strong>,</h3> A task, <a href=\"%%7Btask.staff_link%7D\">#%{task.number}</a> is seriously overdue. <br /><br /> We should all work hard to guarantee that all tasks are being addressed in a timely manner. <br /><br /> Signed,<br /> %{task.dept.manager.name} <hr /> <div>To view or respond to the task, please <a href=\"%%7Btask.staff_link%7D\"><span style=\"color:rgb(84, 141, 212)\">login</span></a> to the support system. You\'re receiving this notice because the task is assigned directly to you or to a team or department of which you\'re a member.</div> <em style=\"font-size:small\">Your friendly <span style=\"font-size:smaller\">(although with limited patience)</span> Customer Support System</em><br /><img src=\"cid:b56944cb4722cc5cda9d1e23a3ea7fbc\" height=\"19\" alt=\"Powered by osTicket\" width=\"126\" style=\"width:126px\" /> ', NULL, '2017-06-13 15:13:23', '2017-06-13 15:13:23'),
(20, 2, 'ticket.autoresp', 'Tiket dibuka [#%{ticket.number}]', '<h3><strong>Yth. Bapak/Ibu %{recipient.name.first},</strong></h3> <p>Tiket permintaan layanan telah dibuat dengan nomor #%{ticket.number}. Tim kami akan menindaklanjuti permintaan Anda sesegera mungkin. Anda dapat <b><a href=\"%%7Brecipient.ticket_link%7D\">melihat perkembangan tiket ini secara online</a></b>. </p> <br /><div > Tim Pusat Layanan TI %{company.name}, <br /> %{signature} </div> <hr /> <div style=\"font-size:small\"><em>Jika Anda ingin memberikan komentar atau informasi tambahan terkait masalah ini, <b><a href=\"%%7Brecipient.ticket_link%7D\">masuklah ke akun Anda</a></b> untuk mendapatkan arsip lengkap permintaan layanan Anda. <b>Mohon tidak menjawab email ini</b>.</em></div>', NULL, '2017-07-17 12:56:30', '2017-07-17 12:56:30'),
(21, 2, 'ticket.autoreply', 'Re: %{ticket.subject} [#%{ticket.number}]', '<h3><strong>Yth. Bapak/Ibu %{recipient.name.first},</strong></h3> Tiket permintaan layanan telah dibuat dengan nomor tiket <b><a href=\"%%7Brecipient.ticket_link%7D\">#%{ticket.number}</a></b> dengan balasan sebagai berikut <br /><br /> Topik: <strong>%{ticket.topic.name}</strong> <br /> Judul Permasalahan: <strong>%{ticket.subject}</strong> <br /><br /> %{response} <br /><br /><div>Tim Pusat Layanan TI %{company.name},<br /> %{signature}</div> <hr /> <div style=\"font-size:small\"><em>Kami harap balasan ini dapat menjawab pertanyaan Anda. Jika Anda ingin memberikan komentar atau informasi tambahan terkait masalah ini, <b><a href=\"%%7Brecipient.ticket_link%7D\">masuklah ke akun Anda</a></b> untuk mendapatkan arsip lengkap permintaan layanan Anda. <b>Mohon tidak menjawab email ini</b>.</em></div> ', NULL, '2017-07-17 12:56:30', '2017-07-17 12:56:30'),
(22, 2, 'message.autoresp', 'Konfirmasi Pesan', '<h3><strong>Yth. Bapak/Ibu %{recipient.name.first},</strong></h3> Balasan Anda untuk permintaan tiket nomor <b><a href=\"%%7Brecipient.ticket_link%7D\">#%{ticket.number}</a></b> telah dicatat. <br /><br /><div > Tim Pusat Layanan TI %{company.name},<br /> %{signature} </div> <hr /> <div style=\"font-size:small;text-align:left\"> <em>Anda dapat melihat perkembangan tiket permintaan layanan secara online <b><a href=\"%%7Brecipient.ticket_link%7D\">di sini</a></b></em> </div>', NULL, '2017-07-17 12:56:30', '2017-07-17 12:56:30'),
(23, 2, 'ticket.notice', '%{ticket.subject} [#%{ticket.number}]', '<h3><strong>Yth. Bapak/Ibu %{recipient.name.first},</strong></h3> Tim Pusat Layanan TI kami telah membuat tiket dengan nomor, <b><a href=\"%%7Brecipient.ticket_link%7D\">#%{ticket.number}</a></b> atas nama Anda, dengan rincian dan ringkasan berikut: <br /><br /> Topik: <strong>%{ticket.topic.name}</strong> <br /> Judul Permasalahan: <strong>%{ticket.subject}</strong> <br /><br /> %{message} <br /><br /> Perwakilan tim kami akan menindaklanjuti keluhan anda sesegera mungkin. Anda juga bisa melihat perkembangan tiket ini <b><a href=\"%%7Brecipient.ticket_link%7D\">secara online</a></b>. <br /><br /><div> Tim Pusat Layanan TI %{company.name},<br /> %{signature}</div> <hr /> <div style=\"font-size:small\"><em>Jika Anda ingin memberikan komentar atau informasi tambahan terkait masalah ini, <b><a href=\"%%7Brecipient.ticket_link%7D\">masuklah ke akun Anda</a></b> untuk mendapatkan arsip lengkap permintaan layanan Anda. <b>Mohon tidak menjawab email ini</b>.</em></div>', NULL, '2017-07-17 12:56:30', '2017-07-17 12:56:30'),
(24, 2, 'ticket.overlimit', 'Pemberitahuan Aktifitas Membuka Tiket Sudah Mencapai Batas Maksimal', ' <h3><strong>Yth. Bapak/Ibu %{ticket.name.first},</strong></h3> Anda telah mencapai jumlah maksimum tiket terbuka yang diperbolehkan. Untuk dapat membuka tiket lain, salah satu tiket anda  harus ditutup. Untuk memperbarui atau menambahkan komentar ke tiket terbuka cukup <b><a href=\"%%7Burl%7D/tickets.php?e=%%7Bticket.email%7D\">masuk ke akun Anda</a></b> pada sistem kami. <br /><br /> Terima kasih,<br /> Tim Dukungan Sistem Layanan TI', NULL, '2017-07-17 12:56:30', '2017-07-17 12:56:30'),
(25, 2, 'ticket.reply', 'Re: %{ticket.subject} [#%{ticket.number}]', '<h3><strong>Yth. Bapak/Ibu %{recipient.name},</strong></h3> %{response} <br /><br /><div> Tim Pusat Layanan TI  %{company.name},<br /> %{signature} </div> <hr /> <div style=\"font-size:small;text-align:left\"><em>Kami harap jawaban ini cukup menjawab pertanyaan Anda. <br /> Jika tidak, mohon <b>TIDAK MEMBALAS</b> ke email ini. <br /> Sebagai gantinya, silahkan  <b><a href=\"%%7Brecipient.ticket_link%7D\">login ke akun Anda</a></b> untuk melihat semua arsip lengkap permintaan dan tanggapan permintaan Anda.</em></div>', NULL, '2017-07-17 12:56:30', '2017-07-17 12:56:30'),
(26, 2, 'ticket.activity.notice', 'Re: %{ticket.subject} [#%{ticket.number}]', ' <h3><strong>Yth. Bapak/Ibu %{recipient.name.first},</strong></h3> <div> <em>%{poster.name}</em> baru saja memasukkan pesan ke tiket yang sudah anda buat. </div> <br /> %{message} <br /><br /><hr /> <div style=\"font-size:small;text-align:left\"> <em>Anda mendapatkan email ini karena Anda adalah kolaborator di tiket <b><a href=\"%%7Brecipient.ticket_link%7D\">#%{ticket.number}</a></b>. Untuk berpartisipasi, cukup <b><a href=\"%%7Brecipient.ticket_link%7D\">klik di sini</a></b> untuk mendapatkan arsip riwayat tiket secara lengkap. Mohon <b>TIDAK MEMBALAS</b> email ini. </em> </div> ', NULL, '2017-07-17 12:56:30', '2017-07-17 12:56:30'),
(27, 2, 'ticket.alert', 'Pemberitahuan Perihal Tiket Baru', '<h2>Hai %{recipient.name},</h2> Tiket baru dengan nomor #%{ticket.number} telah dibuat <br /><br /><table><tbody> <tr> <td> <strong>Dari</strong>: </td> <td> %{ticket.name} </td> </tr> <tr> <td> <strong>Unit Kerja </strong>: </td> <td> %{ticket.dept.name} </td> </tr> </tbody></table> <br /> %{message} <br /><br /><hr /> <div>Untuk melihat atau merespon tiket, silahkan login ke <b><a href=\"%%7Bticket.staff_link%7D\">https://halosis.bps.go.id</a></b></div><br/> <em>Terima kasih,<br/>Tim Dukungan Sistem Layanan TI</em>', NULL, '2017-07-17 12:56:30', '2017-07-17 12:56:30'),
(28, 2, 'message.alert', 'Pesan Baru', ' <h3><strong>Hai %{recipient.name},</strong></h3> Pesan baru telah ditambahkan ke tiket nomor <b><a href=\"%%7Bticket.staff_link%7D\">#%{ticket.number}</a></b> <br /><br /><table><tbody> <tr> <td> <strong>Dari</strong>: </td> <td> %{ticket.name} </td> </tr> <tr> <td> <strong>Unit Kerja</strong>: </td> <td> %{ticket.dept.name} </td> </tr> </tbody></table> <br /> %{message} <br /><br /><hr /> <div>Untuk melihat atau merespon tiket, silahkan login ke <b><a href=\"%%7Bticket.staff_link%7D\">https://halosis.bps.go.id</a></b></div><br/> <em>Terima kasih,<br/>Tim Dukungan Sistem Layanan TI</em> ', NULL, '2017-07-17 12:56:30', '2017-07-17 12:56:30'),
(29, 2, 'note.alert', 'Pemberitahuan Aktifitas Internal Baru', '<h3><strong>Hai %{recipient.name},</strong></h3> Seorang agen telah melakukan aktivitas masuk ke tiket <b><a href=\"%%7Bticket.staff_link%7D\">#%{ticket.number}</a></b> <br /><br /><table><tbody> <tr> <td> <strong>Dari</strong>: </td> <td> %{note.poster} </td> </tr> <tr> <td> <strong>Judul</strong>: </td> <td> %{note.title} </td> </tr> </tbody></table> <br /> %{note.message} <br /><br /><hr /> Untuk melihat atau merespon tiket, silahkan login ke <b><a href=\"%%7Bticket.staff_link%7D\">https://halosis.bps.go.id</a></b><br/> <br /><em>Terima kasih,<br/>Tim Dukungan Sistem Layanan TI</em>', NULL, '2017-07-17 12:56:30', '2017-07-17 12:56:30'),
(30, 2, 'assigned.alert', 'Tiket Ditugaskan untuk Anda', '<h3><strong>Hai %{assignee.name.first},</strong></h3> Tiket <b><a href=\"%%7Bticket.staff_link%7D\">#%{ticket.number}</a></b> telah diberikan kepada Anda oleh %{assigner.name.short} <br /><br /><table><tbody> <tr> <td> <strong>Dari</strong>: </td> <td> %{ticket.name} </td> </tr> <tr> <td> <strong>Subjek</strong>: </td> <td> %{ticket.subject} </td> </tr> </tbody></table> <br /> %{comments} <br /><br /><hr /> <div>Untuk melihat atau merespon tiket, silahkan login ke <b><a href=\"%%7Bticket.staff_link%7D\">https://halosis.bps.go.id</a></b><br/><br/></div> <em>Terima kasih,<br/>Tim Dukungan Sistem Layanan TI</em>', NULL, '2017-07-17 12:56:30', '2017-07-17 12:56:30'),
(31, 2, 'transfer.alert', 'Transfer tiket #%{ticket.number} - %{ticket.dept.name}', '<h3><strong>Hai %{recipient.name},</strong></h3> Tiket <b><a href=\"%%7Bticket.staff_link%7D\">#%{ticket.number}</a></b> telah ditransfer ke Unit Kerja %{ticket.dept.name} oleh <strong>%{staff.name.short}</strong> <br /><br /><blockquote> %{comments} </blockquote> <hr /> <div>Untuk melihat atau merespon tiket, silahkan login ke <b><a href=\"%%7Bticket.staff_link%7D\">https://halosis.bps.go.id</a></b> </div></br/> <em>Terima kasih,<br/>Tim Dukungan Sistem Layanan TI</em>', NULL, '2017-07-17 12:56:30', '2017-07-17 12:56:30'),
(32, 2, 'ticket.overdue', 'Pemberitahuan tiket jatuh tempo', ' <h3><strong>Hai %{recipient.name}</strong>,</h3> Tiket <b><a href=\"%%7Bticket.staff_link%7D\">#%{ticket.number}</a></b> sudah jatuh tempo. <br /><br /> Kita semua harus bekerja keras untuk menjamin bahwa semua tiket ditangani tepat waktu. <br /><br /> Tertanda,<br /> %{ticket.dept.manager.name} <hr /> <div>Untuk melihat atau merespon tiket, silahkan login ke  <b><a href=\"%%7Bticket.staff_link%7D\"><span style=\"color:rgb(84, 141, 212)\">https://halosis.bps.go.id</span></a></b>. Anda menerima pemberitahuan ini karena tiket ditugaskan langsung kepada Anda atau tim atau unit kerja di mana Anda menjadi anggota.</div><br/> <em>Terima kasih,<br/>Tim Dukungan Sistem Layanan TI</em>', NULL, '2017-07-17 12:56:30', '2017-07-17 12:56:30'),
(33, 2, 'task.alert', 'Pemberitahuan Tugas Baru', ' <h2><strong>Hai %{recipient.name},</strong></h2> Tugas baru <b><a href=\"%%7Btask.staff_link%7D\">#%{task.number}</a></b> telah dibuat. <br /><br /><table><tbody><tr> <td> <strong>Unit Kerja</strong>: </td> <td> %{task.dept.name} </td> </tr></tbody></table> <br /> %{task.description} <br /><br /><hr /> <div>Untuk melihat atau merespon tiket, silahkan login ke <b><a href=\"%%7Btask.staff_link%7D\">https://halosis.bps.go.id</a></b></div> <br/><em>Terima kasih,<br/>Tim Dukungan Sistem Layanan TI</em>', NULL, '2017-07-17 12:56:30', '2017-07-17 12:56:30'),
(34, 2, 'task.activity.notice', 'Re: %{task.title} [#%{task.number}]', '<h3><strong>Yth. Bapak/Ibu %{recipient.name.first},</strong></h3> <div> <em>%{poster.name}</em> baru saja mencatat pesan ke sebuah tugas di mana Anda berpartisipasi. </div> <br /> %{message} <br /><br /><hr /> <div style=\"font-size:small;text-align:left\"> <em>Anda mendapatkan email ini karena Anda adalah kolaborator pada tugas #%{task.number}.</em> </div>', NULL, '2017-07-17 12:56:30', '2017-07-17 12:56:30'),
(35, 2, 'task.activity.alert', 'Aktivitas Tugas [#%{task.number}] - %{activity.title}', ' <h3><strong>Hai %{recipient.name},</strong></h3> Tugas <b><a href=\"%%7Btask.staff_link%7D\">#%{task.number}</a></b> telah diperbarui: %{activity.description} <br /><br /> %{message} <br /><br /><hr /> <div>Untuk melihat atau merespon tiket, silahkan login ke <b><a href=\"%%7Btask.staff_link%7D\">https://halosis.bps.go.id</a></b></div> <br/><em>Terima kasih,<br/>Tim Dukungan Sistem Layanan TI</em> ', NULL, '2017-07-17 12:56:30', '2017-07-17 12:56:30'),
(36, 2, 'task.assignment.alert', 'Tugas untuk Anda', '<h3><strong>Hai %{assignee.name.first},</strong></h3> Tugas <b><a href=\"%%7Btask.staff_link%7D\">#%{task.number}</a></b> telah diberikan kepada Anda oleh %{assigner.name.short} <br /><br /> %{comments} <br /><br /><hr /> <div>Untuk melihat atau merespon tiket, silahkan login ke <b><a href=\"%%7Btask.staff_link%7D\">https://halosis.bps.go.id</a></b></div> <br/><em>Terima kasih,<br/>Tim Dukungan Sistem Layanan TI</em> ', NULL, '2017-07-17 12:56:30', '2017-07-17 12:56:30'),
(37, 2, 'task.transfer.alert', 'Transfer tugas #%{task.number} - %{task.dept.name}', ' <h3>Hai %{recipient.name},</h3> Tugas dengan nomor <b><a href=\"%%7Btask.staff_link%7D\">#%{task.number}</a></b> telah ditransfer ke %{task.dept.name} oleh <strong>%{staff.name.short}</strong> <br /><br /><blockquote> %{comments} </blockquote> <hr /> <div>Untuk melihat atau merespon tiket, silahkan login ke <b><a href=\"%%7Btask.staff_link%7D\">https://halosis.bps.go.id</a></b></div><br/><em>Terima kasih,<br/>Tim Dukungan Sistem Layanan TI</em>', NULL, '2017-07-17 12:56:30', '2017-07-17 12:56:30'),
(38, 2, 'task.overdue.alert', 'Pemberitahuan Tugas Jatuh Tempo', ' <h3> <strong>Hai %{recipient.name}</strong>,</h3> Tugas dengan nomor <b><a href=\"%%7Btask.staff_link%7D\">#%{task.number}</a></b> sudah jatuh tempo. <br /><br /> Kita semua harus bekerja keras untuk menjamin bahwa semua tugas ditangani tepat waktu. <br /><br /> Tertanda,<br /> %{task.dept.manager.name} <hr /> <div>Untuk melihat atau merespon tugas, silahkan login ke <b><a href=\"%%7Btask.staff_link%7D\">https://halosis.bps.go.id</a></b>. Anda menerima pemberitahuan ini karena tugas diberikan langsung kepada Anda atau tim atau unit kerja di mana Anda menjadi anggota.</div><br/> <em>Terima kasih,<br/>Tim Dukungan Sistem Layanan TI</em>', NULL, '2017-07-17 12:56:30', '2017-07-17 12:56:30'),
(39, 1, 'input.sipa', 'Formulir SIPA Tiket %{ticket.subject} [#%{ticket.number}]', '<h3><strong>Yth, Bapak/Ibu %{recipient.name.first},</strong></h3> <p> Untuk melengkapi permintaan layanan %{ticket.subject}, <a href=\"%%7Brecipient.ticket_link%7D\">[#%{ticket.number}]</a>, silakan isi formulir melalui link berikut ini: <a href=\"%%7Blink.sipa%7D\">Formulir SIPA</a>. </p> <br/><br/> <div style=\"color:rgb(127, 127, 127)\"> Tim Pusat Layanan TI </div>', NULL, '2018-01-23 09:28:00', '2018-01-23 09:28:00'),
(40, 2, 'input.sipa.notice', 'Formulir SIPA Tiket %{ticket.subject} [#%{ticket.number}]', '<h3><strong>Yth. Bapak/Ibu %{recipient.name.first},</strong></h3> Operator kami telah  membuat sebuah tiket, <a href=\"%%7Brecipient.ticket_link%7D\">[#%{ticket.number}]</a> atas nama Anda, dengan detail sebagai berikut: <br /><br /> Topik: <strong>%{ticket.topic.name}</strong> <br /> Ringkasan Masalah: <strong>%{ticket.subject}</strong> <br /><br /> %{message} <br /><br /> <p> Untuk melengkapi permintaan layanan %{ticket.subject}, <a href=\"%%7Brecipient.ticket_link%7D\">[#%{ticket.number}]</a>, silakan isi formulir melalui link berikut ini: <a href=\"%%7Blink.sipa%7D\">Formulir SIPA</a>. </p> <br/><br/> <div style=\"color:rgb(127, 127, 127)\"> Tim Pusat Layanan TI </div>', NULL, '2018-01-23 09:29:00', '2018-01-23 09:29:00');
