INSERT INTO `ost_faq` (`faq_id`, `category_id`, `ispublished`, `question`, `answer`, `keywords`, `notes`, `created`, `updated`) VALUES
(2, 2, 1, 'UPS mati total', 'Solusi : <br />1. Cek kabel apakah sudah terpasang dengan benar<br /><strong><br />Jika solusi diatas tidak berhasil, buat tiket keluhan ke halosis, sebutkan merk dan tipe perangkat.</strong> ', ' ', 'Kontributor : Seksi Perangkat Keras, Subdit PTI<br />Sumber / Rujukan : -', '2017-08-14 14:46:11', '2018-02-09 11:26:56'),
(3, 2, 1, 'Tombol Power UPS rusak', ' <strong>Buat tiket keluhan ke halosis, sebutkan merk dan tipe perangkat.</strong><br /><br /> ', ' ', 'Kontributor : Seksi Perangkat Keras, Subdit PTI<br />Sumber / Rujukan : -', '2017-08-14 14:49:57', '2018-02-09 11:23:38'),
(4, 5, 1, 'VOIP mati', 'VOIP (voice over internet protocol) mati berarti telepon yang memanfaatkan VOIP ini tidak bisa digunakan. bisa berarti gak ada suara yang keluar sat menelpon, tidak ada suara lawan bicara ketika ditelpon, ataupun tidak ada suara dering yang masuk.<br />penanggulangannya adalah dengan cara memberi tahu ke subdit jkd.<br />udah gitu aja. simpel kan?', ' ', NULL, '2017-08-21 12:31:46', '2017-08-21 12:33:58'),
(5, 3, 1, 'Printer / Scanner paper jam', 'Penyebab :<br />1. Kertas kotor atau lengket atau masih ada stapless nya<br />2. Masih ada kertas / sisa kertas yang menyangkut <br /><br />Solusi : <br />1.Ganti menggunakan kertas yang lebih layak untuk digunakan<br />2.Matikan mesin dan tarik kertas / sisa kertas yang tersangkut searah dengan putaran roller<br /><strong><br />Jika solusi diatas tidak berhasil, </strong><strong>buat tiket keluhan ke halosis, sebutkan merk dan tipe perangkat.</strong> ', ' ', 'Kontributor : PTI', '2017-08-22 11:15:29', '2018-02-09 11:12:10'),
(6, 3, 1, 'Printer / Scanner tidak bisa menarik kertas karena roller atau gearbox rusak', ' <strong>B</strong><strong>uat tiket keluhan ke halosis, sebutkan merk dan tipe perangkat.</strong> ', ' ', 'Kontributor : PTI', '2017-08-22 11:17:50', '2018-02-09 11:12:34'),
(7, 3, 1, 'Hasil print tidak jelas atau buram atau bergaris', 'Penyebab : toner habis <br /> Solusi : Ganti toner<br /><br /><strong>Jika solusi tidak berhasil, b</strong><strong>uat tiket keluhan ke halosis, sebutkan merk dan tipe perangkat.</strong> ', ' ', 'Kontributor : Subdit PTI', '2017-08-22 11:34:57', '2018-02-09 11:10:12'),
(8, 3, 1, 'Hasil print terlipat-lipat', ' <strong>B</strong><strong>uat tiket keluhan ke halosis, sebutkan merk dan tipe perangkat.</strong> ', ' ', 'Kontributor : Seksi perangkat Keras, Subdit PTI', '2017-08-22 11:38:55', '2018-02-09 11:09:21'),
(9, 3, 1, 'Hasil scan bergaris / terdapat noda', 'Penyebab : Scanner kotor<br /> Solusi : Bersihkan mesin scanner <br /><br /><strong>Jika solusi diatas tidak berhasil, b</strong><strong>uat tiket keluhan ke halosis, sebutkan merk dan tipe perangkat.</strong> ', ' ', 'Kontributor : Seksi Perangkat Keras - Subdit PTI', '2017-08-22 11:42:27', '2018-02-09 11:11:22'),
(10, 6, 1, 'backup database aplikasi gagal', ' <strong>A. Penyebab: koneksi terputus</strong><br /><strong>Solusi: </strong><br /> 1. Cek kondisi fisik komputer (kabel LAN, <em>switch</em>, dan lain-lain)<br /> 2. Cek pengaturan jaringan (konfigurasi IP dan non-aktifkan <em>firewall</em>)<br /> 3. Buka <em><strong>command prompt</strong></em>, ketik<strong> ping[spasi][alamat IP komputer lain yang masih dalam satu jaringan]</strong><br /> 4. Jika pada <em>command prompt </em>tampil \"Reply .....\" maka komputer telah terhubung dengan jaringan<br /><br /><strong>B. Penyebab: <em>Database </em>masih melakukan transaksi</strong><br /><strong>Solusi: </strong><br /> 1. Tutup dahulu semua aplikasi <em>client </em>yang sedang terhubung ke aplikasi <em>server </em>tersebut<br />2. Ulangi kembali proses <em>backup database</em><br /><br /><strong>C. Penyebab: <em>Error 5 - Access is denied </em>atau akses ditolak karena masalah autentifikasi<br /> Solusi: </strong><br />Error ini dapat muncul jika lokasi penyimpanan hasil backup database tidak boleh diakses atau Read only. <br />1. Klik kanan nama <em>folder </em>(dimana hasil <em>backup</em> data akan disimpan),pilih <em>properties</em><br />2. Hilangkan pilihan atribut \"<em>Read only</em>\" dan \"<em>Hidden</em>\"<br /><br /><strong>D. Penyebab: <em>Error 23 - Data error (cyclic redundancy check) </em>atau lokasi (media) penyimpanan hasil tidak dapat di Read/Write</strong><br /><strong>Solusi</strong>: Ubah lokasi penyimpanan ke media/lokasi lain<br /><br /><strong>E</strong>. <strong>Penyebab: <em>Error 53 - The network path was not found</em> atau <em>share folder </em>dalam jaringan tidak ditemukan<br /> Solusi: </strong><br />1. Cek apakah <em>path </em>penyimpanan sudah benar<br />2. Matikan <em>firewall</em><br /><br /><strong>F. Penyebab: <em>Error 64 - The specified network name is no longer available</em>.<br />Solusi</strong>: <em>Error </em>ini mungkin disebabkan saat proses <em>backup </em>berlangsung, tiba tiba terjadi masalah jaringan atau komputer tiba-tiba mati/<em>restart</em><br /> ', ' ', 'Seksi IPD Sosial, Seksi IPD Produksi, Seksi IPD Distribusi', '2017-08-23 14:01:32', '2017-08-23 14:19:32'),
(11, 6, 1, 'koneksi database error', ' <strong>A. Penyebab: Komputer belum terhubung jaringan<br />Solusi:<br /></strong>1. Cek kondisi fisik komputer (kabel LAN, switch, dan lain-lain)<br />2. Cek pengaturan jaringan (konfigurasi IP dan non-aktifkan <em>firewall</em>) <br />3. Buka <strong><em>command prompt</em></strong>, ketik <strong>ping[spasi][alamat IP komputer lain yang masih dalam satu jaringan]</strong><br />4. Jika pada <em>command prompt </em>tampil \"<em>Reply ....</em>.\" maka komputer telah terhubung dengan jaringan<br /><br /><strong>B. Penyebab: Alamat database server salah<br />Solusi:<br /></strong>1. Buka halaman pengaturan koneksi <em>database </em>yang telah disediakan pada aplikasi <em>client</em><br />2.Cek format penulisan alamat <em>database server </em>yang digunakan <strong>([alamat IP]\\[nama <em>instance database server</em>])</strong>, misalnya: 10.2.7.69\\SQLEXPRESS1<br />3.Klik \"<strong>Test</strong>\" untuk mencoba apakah aplikasi dapat terhubung ke <em>database server</em><br />4. Jika keluar pesan \"<strong>Koneksi berhasil</strong>\" maka aplikasi telah berhasil terhubung ke<em> database server</em><br />5. Klik \"<strong>Simpan</strong>\" untuk menyimpan pengaturan koneksi <em>database </em>aplikasi<br /><strong><br />C. Penyebab: Database server belum ada<br />Solusi:</strong><br />1. Pastikan aplikasi <em>server </em>telah berhasil diinstal<br />2. Buka aplikasi <em>server</em><br />3. Pilih instance SQL <em>Server </em>yang akan digunakan<br />4. Klik \"<strong>Connect</strong>\" <br />3. Lakukan \"<strong>Create Database</strong>\" <br />4. Lakukan \"<strong>Import data persiapan</strong>\"<br /><br /><strong>D. Penyebab: Service SQL Server (di PC <em>Server</em>) belum aktif<br />Solusi:</strong><br />1. Buka <strong>SQL <em>Server Configuration Manager </em></strong>pada komputer <em>server </em>(<strong>Start--&gt;All Programs--&gt; SQL Server Configuration Manager</strong>)<br />2. Expand <strong>SQL <em>Server Network Configuration</em></strong><br />3. Pilih <strong><em>instance </em></strong>yang digunakan<br />4. Pada <strong>Console Pane</strong>, klik \"<strong>Protocols for\" </strong><br />5. Pastikan <strong><em>Shared Memory</em></strong>,<strong> <em>Named Pipes</em></strong>, <strong>TCP/IP </strong>statusnya <em><strong>Enable</strong></em>, seperti gambar di atas. Jika masih <em>disable </em>statusnya, klik kanan kemudian pilih \"<strong><em>Enable</em></strong>\"<br />6. <strong><em>Restart </em></strong>instance SQL <em>Server </em>tersebut setelah dilakukan <em>treatment </em>seperti di atas. Pada <strong><em>Console Pane</em></strong>, klik \"<strong>SQL <em>Server Services</em>\"</strong><br />7. Pada <em><strong>Details Pane</strong></em>, klik kanan \"<em><strong>SQL Server</strong>\" </em>dan kemudian klik \"<strong><em>Restart</em></strong>\" untuk <em>stop </em>atau <em>restart service </em>SQL <em>server</em><br />8. Jika masih belum bisa terkoneksi antara <em>client </em>dan <em>server</em>:<br />- matikan settingan <em>firewall</em>-nya.<br />- setting <strong><em>User Account Control Settings</em></strong> di <strong>Control Panel </strong>menjadi<strong> </strong>\"<em><strong>Never notify</strong></em>\"<br />9. <em><strong>Restart </strong></em>laptop/PC<br /><br /><strong>E. Penyebab: Belum melakukan <em>setup database </em>(untuk aplikasi IMK)<br />Solusi:</strong><br />1. <em>Database </em>harus dibuat dulu dengan menggunakan menu <strong><em>database setup</em></strong>. Menu ini berfungsi untuk membentuk <em>database </em>VIMK[tahun] Tahunan sesuai dengan wilayah kerja (per provinsi) dan tahun kegiatan. <br />2. Lokasi penyimpanan dapat berupa <em>shared folder </em>jika komputer terhubung oleh jaringan maupun pada hardisk pada <em>local drive</em>. Menu ini hanya dijalankan sekali ketika ingin membentuk <em>database </em>baru. <em>Database </em>yang sudah pernah terbentuk di dalam <em>folder </em>yang dipilih tidak akan pernah terbentuk kembali sebelum <em>database </em>tersebut di hapus secara manual dari dalam <em>folder </em>yang dipilih, untuk menentukan wilayah kerja (provinsi) dilakukan dengan memberikan tanda <strong><em>check</em></strong> pada provinsi yang sesuai. <em>Database </em>dapat dibuat lebih dari satu wilayah kerja pada tahun kegiatan yang sama.<br /><br /><strong>F. Penyebab: <em>Database Location Setting </em>(Pengaturan Lokasi Database) salah (untuk aplikasi IMK)<br />Solusi:</strong><br />1. Lakukan pengaturan Lokasi <em>database </em>kerja melalui menu <em><strong>Database Location Setting</strong></em><br />2.Jika <em>database </em>kerja ada di komputer lain (dalam <em>shared folder </em>melalui <em>network</em>), pilih Telah ada dalam <em>shared folder </em>(melalui <em>network</em>)<br />3. Jika <em>database </em>kerja ada di penyimpanan lokal, maka Pilih <em>folder </em>di <em>local drive</em><br />4. Kemudian <strong><em>Browse </em></strong>lokasi <em>database-</em>nya<br />5. Pilih Tahun<br />6. Pilih Jenis Modul (Triwulan atau Tahunan), Pilih Triwulan (jika jenis modul adalah Triwulan)<br />7. Pilih Wilayah kerja<br />8. Pilih Propinsi kerja<br />9. Klik \"<strong>OK\"</strong><br /><br /><br /><br /> ', ' ', NULL, '2017-08-23 14:33:07', '2017-08-23 15:47:48'),
(12, 4, 1, 'Komputer ( PC atau Laptop atau Tablet ) tidak mau booting atau tidak mau masuk ke sistem operasi', 'Solusi :<br /><strong>Buat tiket keluhan ke halosis, sebutkan merk dan tipe perangkat.</strong> ', ' ', 'Kontributor: Seksi perangkat keras, Subdit PTI', '2017-08-24 11:07:30', '2018-02-09 10:51:21'),
(13, 4, 1, 'Komputer ( PC atau Laptop atau Tablet ) lambat dalam melakukan proses / sering hang / bluescreen', 'A<br />Penyebab: Komputer terserang virus<br />Solusi: Install antivirus dan <em>scan</em> virus menggunakan antivirus berlisensi milik BPS<br /><br />B<br />Penyebab: banyak aplikasi-aplikasi yang terinstall (PC kepenuhan aplikasi)<br />Solusi: <br />- hapus/uninstall aplikasi yang tidak resmi dan atau tidak terpakai lagi.<br />- lakukan <em>disk clean up</em> dan <em>defragment.</em><br /><br /><strong>Apabila solusi diatas tidak berhasil, buat tiket keluhan ke halosis, sebutkan merk dan tipe perangkat.</strong> ', ' ', 'Kontributor: Seksi perangkat keras, Subdit PTI', '2017-08-24 14:06:49', '2018-02-09 10:50:15'),
(14, 4, 1, 'PC atau komputer mati total', 'Solusi:<br />1. Cek kabel <em>power</em> apakah sudah terpasang dengan benar.<br />2. Jika menggunakan UPS, cek kabel dari komputer ke UPS apakah sudah terpasang dengan benar.<br />3. Jika menggunakan UPS, cek apakah UPS sudah dinyalakan atau belum.<br />4. Apabila solusi 1, 2, dan 3 tidak berhasil maka buat tiket keluhan ke halosis dengan menyebutkan merk dan tipe komputer', ' ', 'Kontributor: Seksi perangkat keras, Subdit PTI', '2017-08-24 14:11:14', '2018-02-09 10:38:30'),
(15, 4, 0, 'Monitor pada PC mati total', 'Solusi: <br />1. Cek kabel <em>power</em> apakah sudah terpasang dengan benar.<br />2. Jika menggunakan UPS, cek kabel dari monitor ke UPS apakah sudah terpasang dengan benar.<br />3. Jika menggunakan UPS, cek apakah UPS sudah dinyalakan atau belum.<br /><strong>Apabila solusi diatas tidak berhasil, buat tiket keluhan ke halosis, sebutkan merk dan tipe perangkat.</strong> ', ' ', 'Kontributor: Seksi perangkat keras, Subdit PTI', '2017-08-24 14:15:07', '2018-03-01 16:32:32'),
(16, 4, 1, 'Mouse atau keyboard mengalami kerusakan', 'Solusi :<br />Untuk mouse/keyboard <strong>Wireless</strong><strong>/nirkabel</strong><br />1. Cek baterai.<br />2. Cek USB dongle yang terpasang pada CPU apakah sudah terpasang dengan benar.<br />3. Jika nomor 1 dan 2 masih baik, pindahkan USB dongle pada port USB yang lain.<br /><br />Untuk mouse/keyboard <strong>Wire/kabel</strong><br />1. Coba mouse/keyboard di komputer/laptop lain.<br /><br />Jika semua solusi diatas tidak berhasil, buat tiket keluhan ke halosis dengan menyebutkan merk, tipe dan serial number / <em>Service tag</em> yang terletak diatas CPU', ' ', 'Kontributor: Seksi perangkat keras, Subdit PTI', '2017-08-24 14:22:03', '2018-02-09 10:37:47'),
(17, 4, 1, 'PC atau komputer menyala tetapi tidak muncul tampilan di monitor', '<strong>Buat tiket keluhan ke halosis, sebutkan merk dan tipe perangkat.</strong>', ' ', 'Kontributor: Seksi perangkat keras, Subdit PTI', '2017-08-24 14:27:02', '2018-02-09 10:53:01'),
(18, 4, 1, 'Laptop atau Tablet tidak bisa dicharge', 'Solusi :<br />Buat tiket keluhan ke halosis, sebutkan merk dan tipe perangkat.', ' ', 'Kontributor: Seksi perangkat keras, Subdit PTI', '2017-08-24 14:32:01', '2018-02-09 10:18:12'),
(19, 4, 1, 'Laptop mati total', 'Penyebab: Laptop mengalami kerusakan pada satu atau beberapa <em>sparepart.<br /></em>Solusi: buat tiket keluhan ke halosis dengan menyebutkan merk dan tipe laptop', ' ', 'Kontributor: Seksi perangkat keras, Subdit PTI', '2017-08-24 14:39:30', '2018-02-09 10:37:13'),
(20, 7, 1, 'Tidak bisa login windows', 'Penyebab: Lupa <em>password</em> windows<br />Solusi: <em>Reset</em> password', ' ', 'Kontrbutor: Seksi perangkat keras, Subdit PTI', '2017-08-24 14:58:07', '2017-08-25 10:50:38'),
(21, 7, 1, 'Instalasi software tidak berhasil', 'A<br />Penyebab: Spesifikasi <em>hardware</em> dan <em>softwar</em>e tidak mendukung<br />Solusi: <em>Upgrade software</em> dan <em>hardware</em><br /><br />B<br />Penyebab: <em>Source</em> tidak benar (<em>corrupt</em> atau tidak asli)<br />Solusi: <em>Download</em> dengan menggunakan <em>source</em> yang benar<br /><br />C<br />Penyebab: Instalasi tidak dijalankan sebagai Administrator<br />Solusi: Klik kanan pada <em>file</em> instalasi, klik Run as Administrator<br /><br />D<br />Penyebab: Komputer terkena virus<br />Solusi: Bersihkan komputer dari virus', ' ', 'Kontributor: Seksi perangkat lunak Subdit PTI', '2017-08-25 08:56:33', '2017-08-25 10:50:17'),
(22, 7, 1, 'Windows not genuine', 'Penyebab: Lisensi Windows tidak asli<br />Solusi: <br />a. Ganti Windows asli<br />b. Ganti lisensi Windows dengan yang asli', ' ', 'Kontributor: Seksi perangkat lunak Subdit PTI', '2017-08-25 09:06:17', '2017-08-25 10:50:47'),
(23, 7, 1, 'Aktivasi windows kadaluarsa / kadaluwarsa / kedaluwarsa', 'Penyebab: Windows belum berlisensi atau lisensi kadaluarsa/expired<br />Solusi: Menggunakan lisensi baru', ' ', 'Kontributor: Seksi perangkat lunak Subdit PTI', '2017-08-25 09:10:09', '2017-08-25 10:50:08'),
(24, 7, 1, 'Software tidak berfungsi dengan normal', 'Penyebab: Software <em>corrupt</em><br />Solusi: Instal ulang software yang <em>corrupt</em> ', ' ', 'Kontributor: Seksi perangkat lunak Subdit PTI', '2017-08-25 09:43:39', '2017-08-25 10:50:28'),
(25, 8, 1, 'Aplikasi tidak dapat diakses', 'Penyebab: Server tidak dapat diakses<br />Solusi:<br />a. Memastikan <em>server</em> menyala<br />b. Memastikan <em>application pool</em> menyala<br />(Semua langkah di atas dilakukan oleh admin)', ' ', 'Kontributor: Seksi Perekaman Data, Subdit PTI', '2017-08-25 10:09:55', '2017-10-13 14:07:50'),
(26, 12, 1, 'Error 500 - Internal server error', 'Penyebab: Server <em>busy</em><br />Solusi: <em>Refresh</em> halaman <em>browser</em> ', ' ', 'Kontributor: Seksi Perekaman Data, Subdit PTI', '2017-08-25 10:28:47', '2017-08-25 16:10:55'),
(27, 10, 1, 'User atau pengguna tidak bisa login', 'A<br />Penyebab: Username dan atau password yang dimasukkan salah<br />Solusi:<br />a. Pastikan username yang dimasukkan benar<br />b. Pastikan password yang dimasukkan benar<br />c. Pastikan username dan password dapat digunakan untuk login community (khusus untuk layanan dengan login community)<br />d. Untuk Presensi Online Daerah dan Sipintar, jika user lupa password, password akan diriset (dilakukan oleh admin pusat)<br /><br />B<br />Penyebab: Data pegawai belum sesuai<br />Solusi: Melakukan transfer data pegawai dari data Simpeg (dilakukan oleh admin)<br /><br />C<br />Penyebab: Server database tidak dapat diakses <br />Solusi:<br />a. Memastikan server database menyala<br />b. Memastikan service database dalam status running<br />c. Memastikan database dapat diakses dari aplikasi<br />d. Memeriksa setting firewall.<br />(Semua langkah di atas dilakukan oleh admin)<br /><br />D<br />Penyebab: User belum terdaftar<br />Solusi:<br />a. Memastikan user memiliki hak akses aplikasi<br />b. Menambahkan user<br />(Semua langkah di atas dilakukan oleh admin)<br /><br />E<br />Penyebab: Data status pegawai tidak lengkap<br />Solusi:<br />a. Periksa penulisan email melalui community <br />b. Periksa status pegawai saat ini. Jika status masih kosong, lengkapi data pegawai (dilakukan oleh admin / Bag. Administrasi Kepegawaian ).<br />c. Pastikan username dan password dapat digunakan untuk login community<br /><br />F<br />Penyebab: Terdapat kesalahan penulisan email di community (terdapat spasi sebelum @)<br />Solusi:<br />a. Periksa penulisan email melalui community <br />b. Pastikan pengguna dapat login ke community<br /><br />G<br />Penyebab: Pegawai tidak terdaftar.<br />Solusi: Mendaftarkan pegawai sebagai pengguna (dilakukan oleh admin).<br /><br />H<br />Penyebab: Pegawai tidak mempuyai hak akses.<br />Solusi: Memasikan bahwa pegawai ybs adalah pejabat struktural eselon 1/2/3 aktif pada bulan yang dinilai.', ' ', 'Kontributor: Seksi Perekaman Data, Subdit PTI', '2017-08-25 11:23:44', '2017-08-28 10:13:32'),
(28, 9, 1, 'instalasi aplikasi gagal', ' <strong>Penyebab</strong>: Komputer tidak memenuhi spesifikasi minimum yang disyaratkan<br /><strong>Solusi</strong>: <br />Secara umum spesifikasi minimum komputer yang diperlukan adalah:<br />1. Komputer dengan sistem operasi minimal Windows 7<br />2. Telah terinstall SQL Server 2008 R2<br /> ', ' ', 'Seksi IPD Sosial, Seksi IPD Produksi, Seksi IPD Distribusi', '2017-08-25 13:30:43', '2017-08-25 14:17:01'),
(29, 6, 1, 'create database gagal', ' <strong>Penyebab</strong>: Versi SQL <em>Server </em>lebih rendah dari SQL Server 2008 R2<br /><strong>Solusi</strong>: <em>Upgrade </em>versi SQL <em>Server </em>minimal 2008 R2<br /> ', ' ', 'Seksi IPD Sosial, Seksi IPD Produksi, Seksi IPD Distribusi', '2017-08-25 14:22:32', '2017-08-25 14:22:32'),
(30, 6, 1, 'restore database gagal', 'A. <strong>Penyebab: <em>Fi</em></strong><em>le backup </em>tidak sesuai<strong><br />Solusi: </strong>Cek kembali apakah <em>file </em>yang akan di-<em>restore </em>benar benar <em>file </em>hasil backup dari aplikasi <em>server</em>. <em>File backup </em>biasanya berekstensi <strong>[namaaplikasi].bakz</strong><br /><br />B. <strong>Penyebab: </strong>Memori komputer tidak cukup<br /><span><strong>Solusi: </strong>Pastikan kapasitas komputer yang digunakan untuk melakukan <em>restore database </em>masih mencukupi.</span><strong><br /></strong> ', ' ', NULL, '2017-08-25 14:27:06', '2017-08-25 14:27:06'),
(31, 10, 1, 'user atau pengguna tidak bisa login ke aplikasi', 'A. <strong>Penyebab</strong>: <strong><em>username </em></strong>atau <strong><em>password </em></strong>salah<br /><strong>Solusi</strong>: pastikan <em><strong>username </strong></em>dan <strong><em>password </em></strong>yang dimasukkan benar<br /><br />B. <strong>Penyebab</strong>: <em><strong>username </strong></em>belum terdaftar<br /><strong>Solusi</strong>: <br />1. <strong>Login </strong>sebagai <strong><em>administrator</em></strong><br />2. <strong>Tambahkan </strong>sebagai <em>user </em>atau pengguna<em> </em>baru<br /> ', ' ', 'Seksi IPD Sosial, Seksi IPD Produksi, Seksi IPD Distribusi', '2017-08-25 14:40:41', '2018-02-21 09:21:23'),
(32, 10, 1, 'user atau pengguna tidak dapat mengubah password', ' <strong>Penyebab</strong>: <em>Password </em>yang diganti bukan merupakan <em>password </em>dari <em>account </em>user yang sedang aktif (<em>login</em>)<br /><strong>Solusi</strong>: <em>User </em>tidak dapat mengubah <em>password </em>dari user lainnya. Pastikan <em>Password </em>yang diganti adalah <em>password </em>dari <em>account user </em>yang sedang aktif (<em>login</em>)', ' ', 'Seksi IPD Sosial, Seksi IPD Produksi, Seksi IPD Distribusi', '2017-08-25 14:51:25', '2018-02-21 09:22:16'),
(33, 10, 1, 'Hak akses , kegiatan , atau data lain yang ditampilkan tidak sesuai', 'Penyebab: Data pegawai belum sesuai<br />Solusi: Melakukan transfer data pegawai dari data Simpeg (dilakukan oleh admin)<span><br /></span> ', ' ', 'Kontributor: Seksi Perekaman Data, Subdit PTI', '2017-08-25 16:17:57', '2017-08-25 16:17:57'),
(34, 11, 1, 'Report atau laporan tidak muncul', 'A<br />Penyebab: Koneksi internet kurang stabil<br />Solusi: Periksa koneksi internet yang digunakan<br /><span><br />B<br /></span>Penyebab: <em>Report server </em>dan atau <em>report servic</em><em>e</em> tidak dapat diakses<br />Solusi: <br />a. Memastikan <em>report server</em> menyala<br />b. Memastikan <em>report service</em> menyala<br />(Semua langkah di atas dilakukan oleh admin)', ' ', 'Kontributor: Seksi Perekaman Data, Subdit PTI', '2017-08-25 16:25:29', '2017-08-25 16:25:29'),
(35, 11, 1, 'File sudah diupload , tetapi setelah pindah halaman atau submit , file tersebut hilang', 'Penyebab: User belum meng-klik tombol upload setelah memilih dokumen yang diupload<br />Solusi:<br />a. Admin inpassing menolak usulan pengajuan inpassing pegawai bersangkutan (apabila sudah disubmit)<br />b. User atau operator meng-upload dokumen', ' ', 'Kontributor: Seksi Perekaman Data, Subdit PTI', '2017-08-25 16:31:58', '2017-08-25 16:31:58'),
(36, 11, 1, 'Jenis ujian tidak sesuai', 'Penyebab: Data tidak sesuai<br />Solusi: Memperbaiki isian database Aplikasi Uji Kompetensi (dilakukan oleh admin)<span><br /></span> ', ' ', 'Kontributor: Seksi Perekaman Data, Subdit PTI', '2017-08-25 16:35:07', '2017-08-25 16:35:07'),
(37, 10, 1, 'User atau pengguna tidak bisa login dan form login muncul berulang-ulang (looping)', 'A<br />Penyebab: Koneksi internet menggunakan speedy<br />Solusi: Ganti dengan menggunakan koneksi internet yang lain<br /><br />B<br />Penyebab: Ketika login tidak menyertakan domain bps<span><br />Solusi:<br />a. Pastikan username yang dimasukkan benar dengan menyertakan domain bps<br />Contoh: bps\\username<br />Setelah domain bps, gunakan backslash (\\), bukan garis miring<br />b. Pastikan password yang dimasukkan benar<br />c. Pastikan username dan password dapat digunakan untuk login community<br /><br />C<br />Penyebab: Username yang terdaftar masih berupa NIP<br />Solusi:<br /></span>a. Hapus user bersangkutan dari daftar pengguna<br />b. Login community dengan menggunakan akun user bersangkutan<br />c. Tambahkan kembali user tesebut ke daftar pengguna<br />d. Login kembali ke aplikasi TK Online<br />e. Jika belum berhasil, silakan menghubungi helpdesk kembali', ' ', 'Kontributor: Seksi Perekaman Data, Subdit PTI', '2017-08-25 16:54:15', '2017-08-25 16:54:15'),
(38, 10, 1, 'User atau pengguna berhasil masuk ke aplikasi TK Online tetapi menu aplikasi tidak muncul', 'Penyebab: User yang bersangkutan terdaftar sebagai operator tetapi username-nya belum terdaftar pada user group.<br />Solusi: Menambahkan username pada user group yang sesuai.<span><br /></span> ', ' ', 'Kontributor: Seksi Perekaman Data, Subdit PTI', '2017-08-28 07:36:45', '2017-08-28 07:36:45'),
(39, 10, 1, 'Tidak bisa menambah operator baru pada aplikasi TK Online', 'A<br />Penyebab: User yang bersangkutan tidak memiliki wewenang.<br />Solusi: Untuk mengelola operator aplikasi TK Online, dapat menghubungi penanggung jawab masing-masing satker.<br />Penanggung jawab untuk satker provinsi adalah Kabag TU, sedangkan penanggung jawab untuk satker kabupaten/kota adalah Kepala BPS Kab/Kota.<br /><br />B<br />Penyebab: Jumlah user yang terdaftar untuk satker tersebut sudah maksimal (3 orang).<br />Solusi: Setiap satker hanya dapat mendaftarkan 3 pegawai sebagai operator TK Online, satu sebagai penanggung jawab, dua sebagai operator entri.', ' ', 'Kontributor: Seksi Perekaman Data, Subdit PTI', '2017-08-28 08:19:12', '2017-08-28 08:19:12'),
(40, 10, 1, 'Username yang tercatat pada aplikasi TK Online tidak sama dengan username yang digunakan untuk login community', 'Penyebab: Username community tersebut belum disinkronisasi dengan username yang ada di Active Directory.<br />Solusi: <br />a. Sinkronisasi antara username di community dan username di Active Directory.<br />(dilakukan oleh admin)<br />b. Admin akan menghubungi jika sudah disinkronisasi<br />c. Pastikan dapat digunakan pada login community<br />d. Login aplikasi TK Online dengan menyertakan domain bps.<br />Username: bps\\[username community]<br />Password: [password community]', ' ', 'Kontributor: Seksi Perekaman Data, Subdit PTI', '2017-08-28 08:24:12', '2017-08-28 08:24:12'),
(41, 10, 1, 'Status pegawai , jabatan atau grade tidak berubah walaupun sudah melakukan pengajuan melalui aplikasi TK Online', 'A<br />Penyebab: Perubahan status mulai berlaku pada penghitungan TK sejak TMT + 1 bulan. <br />Solusi: Tidak ada yang perlu dilakukan, perubahan akan otomatis terjadi sesuai masa berlaku-nya.<br /><br />B<br />Penyebab: Pengajuan belum disetujui atau ditolak.<br />Solusi: <br />Untuk pengajuan yang memang belum disetujui, pengguna harus menunggu sampai pengajuan disetujui. <br />Untuk pengajuan yang ditolak, pengguna dapat memperbaiki pengajuan yang telah diusulkan dengan memperhatikan alasan penolakan.', ' ', 'Kontributor: Seksi Perekaman Data, Subdit PTI', '2017-08-28 08:30:19', '2017-08-28 08:30:19'),
(42, 9, 1, 'Aplikasi error', 'A<br />Penyebab: Data corrupt<br />Solusi: <br />a. Memastikan file mana yang corrupt <br />b. Fixing TPS <br />c. Me-replace (mengganti) data yang sudah fix<br />d. Mengganti owner data agar aplikasi dapat dipakai kembali<br />(Semua langkah tersebut dilakukan oleh admin)<br /><br />B<br />Penyebab: Komputer terkena virus<br />Solusi: <br />a. Memeriksa alamat IP komputer mana yang terkena virus <br />b. Melakukan blok komputer tersebut agar tidak bisa masuk ke sistem <br />c. Membersihkan komputer tersebut dari virus<br />d. Melakukan unblock terhadap komputer tersebut<br />(Semua langkah tersebut dilakukan oleh admin)', ' ', 'Kontributor: Seksi Perekaman Data, Subdit PTI', '2017-08-28 08:36:12', '2017-08-28 08:36:12'),
(43, 9, 1, 'Jam di mesin handkey tidak sesuai regional daerah', 'A<br />Penyebab: Jam di mesin handkey tidak tersinkronisasi dengan server aplikasi presensi online<br />Solusi: <br />a. Pastikan status mesin online di aplikasi presensi online<br />b. Pastikan mesin tidak rusak<br /><br />B<br />Penyebab: Data zona waktu (Time Zone/TZ) yang terdapat di aplikasi woowtime salah<span><br /></span>Solusi: Pastikan isian data Time Zone untuk mesin handkey yang ada di aplikasi presensi online benar', ' ', 'Kontributor: <br />a. Seksi Perekaman Data, Subdit PTI<br />b. Subdit JKD', '2017-08-28 08:43:18', '2017-08-28 08:43:18'),
(44, 13, 1, 'Mesin handkey tidak ada security ketika mengakses menu di dalamnya', 'Penyebab: Tidak ada pegawai yang dijadikan admin, supervisor / enroller pada aplikasi presensi online<br />Solusi: Pastikan ada pegawai di aplikasi presensi online yang dijadikan admin, supervisor / enroller', ' ', 'Kontributor: Seksi Perekaman Data, Subdit PTI', '2017-08-28 08:46:53', '2017-08-28 08:51:08'),
(45, 9, 1, 'Hari libur Nasional / Daerah dihitung hari kerja oleh aplikasi presensi online', 'Penyebab: Hari libur Nasional / Daerah belum dientri ke aplikasi presensi online<br />Solusi: Pastikan Hari Libur Nasional / Daerah sudah dientri ke aplikasi presensi online (dilakukan oleh admin pusat)<span><br /></span> ', ' ', 'Kontributor: Seksi Perekaman Data, Subdit PTI', '2017-08-28 08:53:47', '2017-08-28 08:53:47'),
(46, 9, 1, 'Fingerprint pegawai tidak bisa digunakan untuk absen / tidak terbaca dengan baik oleh mesin handkey', 'Penyebab: Ada masalah dengan sidik jari pegawai<br />Solusi: Tambahkan password untuk pegawai tersebut di presensi online untuk security pegawai tersebut di mesin handkey', ' ', 'Kontributor: Seksi Perekaman Data, Subdit PTI', '2017-08-28 08:57:10', '2017-08-28 08:57:10'),
(47, 9, 1, 'Tidak bisa absen', 'Penyebab: Mesin rusak, mati listrik dll<br />Solusi: Lakukan entri manual jam datang / jam pulang melalui menu roster management', ' ', 'Kontributor: Seksi Perekaman Data, Subdit PTI', '2017-08-28 09:01:05', '2017-08-28 09:01:05'),
(48, 10, 1, 'User atau pengguna tidak bisa masuk BackOffice', 'Penyebab: User belum dimasukkan ke sistem BackOffice<br />Solusi: Melakukan import user tersebut ke BackOffice dan memberikan hak akses yang tepat untuk user tersebut (dilakukan oleh admin)', ' ', 'Kontributor: Seksi Perekaman Data, Subdit PTI', '2017-08-28 09:16:12', '2017-08-28 09:16:12'),
(49, 11, 1, 'Modul tertentu tidak muncul ketika masuk ke BackOffice', 'Penyebab: User belum didaftarkan ke roles dan hak akses yang tepat<br />Solusi: Memastikan telah memberikan roles dan hak akses yang tepat untuk user tersebut <br />(dilakukan oleh admin)', ' ', 'Kontributor: Seksi Perekaman Data, Subdit PTI', '2017-08-28 09:19:02', '2017-08-28 09:19:02'),
(50, 11, 1, 'Jumlah jam lembur ketika proses absen lembur tidak sesuai', 'Penyebab: User belum memeriksa usulan lembur yang terdaftar dan presensi pegawai<br />Solusi: <br />a. Pastikan jumlah usulan lembur yang terdaftar untuk pegawai bersangkutan telah sesuai<br />b. Pastikan bahwa syarat lembur telah terpenuhi. Contohnya untuk lembur hari biasa jam datang ', ' ', 'Kontributor: Seksi Perekaman Data, Subdit PTI', '2017-08-28 09:46:07', '2017-08-28 09:46:07'),
(51, 9, 1, 'Pegawai tidak dapat dimasukkan di usulan lembur', 'Penyebab: Pegawai tersebut mempunyai status tidak aktif seperti pensiun dan unit kerja tersebut baru melakukan usulan lembur setelah lewat bulan lembur<br />Solusi: Melakukan perubahan status pegawai secara sementara di tabel pegawai BackOffice menjadi status aktif (kdstpeg=02) (dilakukan oleh admin)', ' ', 'Kontributor: Seksi Perekaman Data, Subdit PTI', '2017-08-28 13:49:53', '2017-08-28 13:49:53'),
(52, 9, 1, 'Tidak dapat mengirim usulan lembur ke Eselon II', 'Penyebab: Terdapat pegawai yang tidak mempunyai usulan lembur dan total nilai lemburnya adalah 0<br />Solusi: Hapusan daftar pegawai yang mempunyai nilai lembur 0<span><br /></span> ', ' ', 'Kontributor: Seksi Perekaman Data, Subdit PTI', '2017-08-28 13:54:14', '2017-08-28 13:54:14'),
(53, 11, 1, 'POK tidak muncul ketika mengisi daftar POK di form permintaan belanja', 'Penyebab: POK tidak dikategorikan ke tipe form permintaan belanja yang sesuai<br />Solusi: Masukkan POK ke dalam tipe form yang sesuai<span><br /></span> ', ' ', 'Kontributor: Seksi Perekaman Data, Subdit PTI', '2017-08-28 13:56:48', '2017-08-28 13:56:48'),
(54, 11, 1, 'Permintaan belanja yang baru ditambahkan tidak terdapat di daftar', 'Penyebab: Pencarian belum diubah dengan status usulan \"Create Eselon 3\"<br />Solusi: Ubah pencarian status usulan menjadi \"Create Eselon 3\" karena secara default status usulan berisi pencarian \"Proses Hari Ini\"<span><br /></span> ', ' ', 'Kontributor: Seksi Perekaman Data, Subdit PTI', '2017-08-28 14:05:20', '2017-08-28 14:05:20'),
(55, 11, 1, 'Nilai Pagu POK yang sudah direvisi belum sesuai', 'Penyebab: Revisi belum disetujui oleh admin anggaran<br />Solusi: Pastikan revisi sudah disetujui oleh admin anggaran kalau belum disetujui maka menunggu revisi tersebut disetujui oleh admin anggaran<span><br /></span> ', ' ', 'Kontributor: Seksi Perekaman Data, Subdit PTI', '2017-08-28 14:07:34', '2017-08-28 14:07:34'),
(56, 11, 1, 'Daftar POK milik unit kerja tidak sesuai', 'Penyebab: POK tidak didaftarkan ke unit kerja tersebut<br />Solusi: Ubah kode organisasi yang bertanggung jawab terhadap POK tersebut<span><br /></span> ', ' ', 'Kontributor: Seksi Perekaman Data, Subdit PTI', '2017-08-28 14:10:49', '2017-08-28 14:10:49'),
(57, 11, 1, 'Daftar pegawai yang muncul tidak sesuai', 'A<br />Penyebab: Pegawai penilai belum / tidak mempunyai hak akses untuk menilai pegawai pada unit yang bersangkutan pada bulan yang dinilai<br />Solusi: Memasikan bahwa pegawai ybs adalah pejabat struktural eselon 1/2/3 aktif di unit ybs pada bulan yang dinilai.<br /><br />B<br />Penyebab: Data kepegawaian belum sesuai<span><br />Solusi: Melakukan penyesuaian data pegawai (dilakukan oleh admin).<br /></span> ', ' ', 'Kontributor: Seksi Perekaman Data, Subdit PTI', '2017-08-28 14:17:34', '2017-08-28 14:17:34'),
(58, 11, 1, 'Data rekap presensi tidak sesuai', 'Penyebab: Data presensi diperbarui di Kepegawaian dan belum melewati jadwal scheduler rekap presensi. <br />Solusi: <br />1. Memberikan informasi bahwa data rekap akan sesuai setelah jadwal scheduler rekap.<br />2. Jika data rekap dibutuhkan segera (sebagai bahan pertimbangan pengisian prestasi), admin menjalankan scheduler rekap secara manual (dilakukan oleh admin)', ' ', 'Kontributor: Seksi Perekaman Data, Subdit PTI', '2017-08-28 14:21:58', '2017-08-28 14:21:58'),
(59, 11, 1, 'Penggantian foto', 'Penyebab: Penggantian foto di simpeg, tidak merubah foto di community<br />Solusi: Memberikan informasi bahwa foto di community akan berubah 1x 24 jam setelah pengajuan usulan foto di simpeg disetujui oleh supervisor', ' ', 'Kontributor: Seksi Perekaman Data, Subdit PTI', '2017-08-28 14:25:06', '2017-08-28 14:25:27'),
(60, 11, 1, 'Data pegawai tidak sesuai', 'Penyebab: Data pegawai ybs tidak sesuai , tetapi tidak dapat melakukan perbaikan <br />Solusi: memberikan informasi usulan dam pembaharuan data dapat dilakukan oleh pengguna sesuai hak akses yang tercantum pada menu Panduan, pada baris \"Hak Akses Pengguna\"', ' ', 'Kontributor: Seksi Perekaman Data, Subdit PTI', '2017-08-28 14:55:13', '2017-08-28 14:55:13'),
(61, 11, 1, 'Data Istri dan Anak tidak sesuai', 'Penyebab: Data Istri &amp; Anak tidak sesuai tetapi tidak dapat melakukan pembaharuan data<br />Solusi: memberikan informasi bahwa yang dapat melakukan usulan / pembaharuan data istri dan anak adalah petugas kab./kota, operator provinsi dan bagian administrasi kepegawaian.', ' ', 'Kontributor: Seksi Perekaman Data, Subdit PTI', '2017-08-28 15:00:03', '2017-08-28 15:00:29'),
(62, 11, 1, 'Gagal upload file', 'A<br />Penyebab: Pengguna tidak mempunyai akses untuk upload file jenis tersebut <br />Solusi: <br />a. meminta informasi pesan error yang tampil pada halaman gagal upload.<br />b. Memberikan informasi, hak akses upload file ada pada menu Panduan pada baris \"Hak Akses Pengguna\".<br />c. Meminta bantuan petugas yang berhak meng-upload file jenis tersebut sesuai petunjuk pada panduan \"Hak Akses Pengguna\" untuk meng-upload di Simpeg<br /><br />B<br />Penyebab: Tempat penyimpanan arsip, penuh<br />Solusi: <br />a. Memeriksa tempat penyimpanan arsip<br />b. Memindahkan file ke tempat penyimpananan dengan space yang lebih banyak (dilakukan oleh admin)', ' ', 'Kontributor: Seksi Perekaman Data, Subdit PTI', '2017-08-28 15:03:52', '2017-08-28 15:03:52'),
(63, 13, 1, 'Web tidak dapat diakses', 'Penyebab: Web tidak dapat diakses<br />Solusi: <br />a. Memeriksa koneksi jaringan web bps yang lain ,misal : community<br />b. Memeriksa koneksi server hosting dan server database (dilakukan oleh admin)', ' ', 'Kontributor: Seksi Perekaman Data, Subdit PTI', '2017-08-28 15:08:42', '2017-08-28 15:42:37'),
(70, 9, 1, 'Gagal create job diKTA untuk pengolahan sensus dengan KTA', 'Penyebab : Service KTA belum jalan<br />Solusi : <br />1. Tutup browser<br />2. Restart semua service yang berhubungan dengan KTA local service, misal:<br /> a. Kofax Import Connector<br /> b. Kofax License Server<br /> c. Kofax TotalAgility Core Worker<br /> d. Kofax TotalAgility Export Worker, dll<br />3. Buka kembali Daftar Penerimaan Dokumen<br />4. Jika belum muncul setelah beberapa saat, cek pada Menu Cek Posisi Dokumen Menurut Batchname<br />5. Silakan Delete Job/Batchname dengan status suspend.<br />6. Silakan lakukan penerimaan dokumen kembali.<br /><br /> ', 'sensus, pengolahan, KTA, create, job', 'Kontributor : Seksi IPD Sosial, Seksi IPD Produksi, Seksi IPD Distribusi <br />Sumber / Rujukan : <br />1. Buku Pedoman Pengolahan<br />2. Suplemen Aplikasi Pengolahan<br />3. Kejadian sebelumnya<br /> ', '2017-09-06 09:45:52', '2017-09-06 09:51:37'),
(71, 9, 1, 'Pesan Error : Failed to executed rule: \"br_GetDoubleNSBS\" The executor returned: \"Straight through processing of a process failed. The executor said \"Error. Failed to execute business rule: . In the event you require technical assistance please reference', 'Penyebab : Karena memasukkan kembali BS yang sama, padahal job tersebut belum terbentuk (belum muncul di Daftar Dokumen)<br /><br />Solusi : <br />1.Tutup browser<br />2. Restart IIS <br />3. Restart service KTA <br />4. Buka kembali Penerimaan dokumen, dan lakukan penerimaan untuk dokumen yang berbeda.<br />5. Untuk dokumen yang eror tadi, silakan Delete di Cek Posisi Dokumen (status suspend)<br /><br /> ', 'sensus, KTA, br_GetDoubleNSBS, business rule', 'Kontributor : Seksi IPD Sosial, Seksi IPD Produksi, Seksi IPD Distribusi <br />Sumber / rujukan : <br />1. Buku Pedoman Pengolahan<br />2. Suplemen Aplikasi Pengolahan<br />3. Kejadian sebelumnya<br /> ', '2017-09-06 10:00:30', '2017-09-06 10:00:30'),
(72, 9, 1, 'Pesan Error : Failed to executed rule: \"br_createResourceTromDB\" The executor returned: \"Straight through processing of a process failed. The executor said \"Error. Failed to execute business rule: . In the event you require technical assistance please re', 'Penyebab : Hal ini terjadi karena membuat resource (operator) dengan menggunakan login selain adminkab. <br /><br />Solusi : Login kembali sebagai adminkab<span><br /><br /></span> ', 'sensus, KTA, br_createResourceTromDB, business rule', 'Kontributor : Seksi IPD Sosial, Seksi IPD Produksi, Seksi IPD Distribusi <br />Sumber / rujukan : <br />1. Buku Pedoman Pengolahan<br />2. Suplemen Aplikasi Pengolahan<br />3. Kejadian sebelumnya<br /> ', '2017-09-06 10:27:43', '2017-09-06 10:27:43'),
(73, 9, 1, 'Pesan Error:  Argument NotFound Debugging resource strings are unavailable. Often the key and arguments provide ..', 'Solusi : Klik tombol OK', 'sensus, KTA, argument NotFound, Debugging resource strings ', 'Kontributor : Seksi IPD Sosial, Seksi IPD Produksi, Seksi IPD Distribusi <br />Sumber / rujukan : <br />1. Buku Pedoman Pengolahan<br />2. Suplemen Aplikasi Pengolahan<br />3. Kejadian sebelumnya<br /> ', '2017-09-06 10:41:05', '2017-09-06 10:41:05'),
(74, 9, 1, 'Aplikasi tertutup dengan cara tidak normal (aplikasi web)', 'Penyebab : Aplikasi tertutup lewat tombol close (baik tab page maupun browser) atau dengan cara lainnya<br /><br />Solusi : Aplikasi harus dibuka kembali di komputer yang sama <br />Data yang sudah dientri masih tersimpan di local computer, tetapi belum tersimpan di server pusat. Untuk membuka kembali, harus pada computer yang sama. Hal ini dimaksudkan untuk menjaga konsistensi data yang tersimpan di server.<br />Untuk meload kembali tampilan tetap membutuhkan koneksi internet.<br /><br /><br /> ', 'web, tertutup, tidak normal', 'Kontributor : Seksi IPD Sosial, Seksi IPD Produksi, Seksi IPD Distribusi <br />Sumber / Rujukan : <br />1. Buku Pedoman Pengolahan<br />2. Suplemen Aplikasi Pengolahan<br />3. Kejadian sebelumnya<br /> ', '2017-09-06 10:45:49', '2017-09-06 10:45:49'),
(75, 9, 1, 'Gagal simpan (upload) data ke server pusat (aplikasi web)', 'Penyebab : Koneksi Terputus<br />Solusi :<br />1. jika koneksi terputus data yang sudah dientri dapat tersimpan di lokal komputer.<br />Pesan yang muncul adalah: <br />Data disimpan di lokal (gagal ke server) dengan kondisi error/clean <br />2. Untuk menghindari ketidakkonsistenan data yang tersimpan, jangan membuka dokumen untuk identitas yang sama di komputer yang berbeda.<br /><br />Contoh: operator 1 sedang melakukan entri data dokumen A di komputer 1. Entrian belum selesai, tetapi dia harus meninggalkan sebentar pekerjaan entri data tsb. Operator 1 telah menyimpan isian (klik tombol simpan) dan pergi meninggalkan komputer 1. Maka saat operator 1 akan melanjutkan pekerjaannya mengentri dokumen A kembali, dia harus membuka dokumen A tsb di komputer yang sama (komputer 1). <br /><br /><br /><br /> ', 'web, gagal, simpan, upload, data, server', 'Kontributor : Seksi IPD Sosial, Seksi IPD Produksi, Seksi IPD Distribusi <br />Sumber / Rujukan : <br />1. Buku Pedoman Pengolahan<br />2. Suplemen Aplikasi Pengolahan<br />3. Kejadian sebelumnya<br /> ', '2017-09-06 10:49:57', '2017-09-06 10:49:57'),
(76, 9, 1, 'Gagal Import DSRT di aplikasi client (SUSENAS)', '1. Penyebab : Login komputer tidak sebagai administrator<br /> Solusi : Jalankan aplikasi client dengan \"Run as administrator\"<br /><br />2. Penyebab : Belum ada komponen VFPOLEDB<br /> Solusi :<br /> 1. install VFPOLEDBSetup.msi yang sudah ada di folder \\Aplikasi\\Ext\\ <br /> 2. Apabila user menggunakan Windows 8 dan tidak bisa menjalankan VFPOLEDBSetup.msi dengan run as administrator, berikut langkah-langkah yang bisa dilakukan:<br /> a. Melalui program files, ketikkan cmd<br /> b. Klik kanan, pilih Run as Administrator<br /> c. Dilanjutkan, ketikkan command di bawah ini Msiexec /a  lokasi installer VFPOLEDBSetup.msi<br /> Misal, pada PC, lokasi VFPOLEDBSetupSetup.msi berada di D:\\__KERJAAN\\2016\\SUSENAS2016\\Semester 1\\Bahan Ajar\\Pelatihan Pengolahan SSN2016\\Aplikasi\\Ext\\<br /> Maka cara pengetikan di command prompt adalah seperti berikut ini:<br />msiexec /a \"D:\\__KERJAAN\\2016\\SUSENAS2016\\Semester 1\\Bahan Ajar\\Pelatihan Pengolahan SSN2016\\Aplikasi\\Ext\\VFPOLEDBSetup.msi\"<br /> d. Klik Enter, untuk menjalankan VFPOLEDBSetup.msi. Jika command prompt diketikkan dengan benar, maka installer akan berjalan<br /> e. Pada tahapan pengisian \"Network Location\" pada kolom Folder isikan \"C:\\Program FIles (x86)\\Microsoft Visual FoxPro ole DB Provider\\\"<br /> f. Buka lokasi yang di-copy tadi, contoh diatas lokasinya adalah C:\\Program Files (x86)\\Microsoft Visual FoxPro OLE DB Provider\\<br /> g. Buka folder Program Files &gt; Common Files &gt; System &gt;ole db. Pada folder ole db akan ada file bernama vfpoledb.dll<br /> h. Copy lokasi vfpoledb.dll berikut ini:<br /> C:\\Program Files (x86)\\Microsoft Visual FoxPro OLE DB Provider\\Program Files\\Common Files\\System\\ole db<br /> i. Buka kembali folder \\Aplikasi\\Ext\\. Ada file-file berikut ini reg_32_vfp.bat dan reg_64_vfp.bat<br /> j. Sesuaikan bit OS Laptop/PC yang akan diinstall. Jika OS laptop 64 bit, maka pilih reg_64_vfp.bat.<br /> k. Klik kanan reg_64_vfp.bat, kemudian pilih Edit with Notepad <br /> l. Setelah dibuka melalui notepad, maka muncul :<br /> regscr32 \"C:\\Program Files (x86)\\Common Files\\System\\Ole DB\\vfpoledb.dll\" yang ada di notepad, dengan lokasi vfpoledb.dll sesuai dengan laptop masing-masing. Contohnya, jika lokasinya sama seperti panduan sebelumnya, maka cara penulisannya adalah berikut ini<br />regsvr32 \"C:\\Program Files (x86)\\Microsoft Visual FoxPro OLE DB Provider\\Program Files\\Common Files\\System\\ole db\\vfpoledb.dll\"<br />Setelah selesai edit lokasi, Save notepad tersebut, kemudian Close notepad.<br /> m. Pilih kembali reg_64_vfp.bat dengan klik kanan dan Run as Administrator<br /> n. Setelah dijalankan dengan run as administrator, muncul konfirmasi register dll sukses<br /><br />3. Penyebab : DSRT sudah pernah diimport sebelumnya<br />Solusi : Jangan import file untuk DSRT yang sama<br /><br /><br /><br /><br /> ', 'SUSENAS, import, DSRT, client', 'Kontributor : Seksi IPD Sosial, Seksi IPD Produksi, Seksi IPD Distribusi <br />Sumber / Rujukan :<br />1. Buku Pedoman Pengolahan<br />2. Suplemen Aplikasi Pengolahan<br />3. Kejadian sebelumnya<br /> ', '2017-09-06 14:00:36', '2017-09-06 14:43:15'),
(77, 9, 1, 'Pesan Error : sudah instalasi VFPOLEDBSetup.msi di laptop 32 bit tetapi masih belum terdeteksi, dan muncul error \"VFPOLEDB1.0 is not registered on the local Machine\" (SUSENAS)', 'penyebab : Login komputer tidak sebagai administrator<br />Solusi : Klik kanan reg_32_vfp.bat atau reg_64_vfp.bat pilih Run As Administrator<br /><br /> ', 'SUSENAS, VFPOLEDBSetup.msi, VFPOLEDB', 'kontributor : Seksi IPD Sosial, Seksi IPD Produksi, Seksi IPD Distribusi <br />sumber / rujukan : <br />1. Buku Pedoman Pengolahan<br />2. Suplemen Aplikasi Pengolahan<br />3. Kejadian sebelumnya<br /> ', '2017-09-06 14:50:20', '2017-09-06 14:51:11'),
(78, 9, 1, 'Range harga sudah sesuai tapi aplikasi mendeteksi harga di luar range', 'Penyebab : Pengaturan regional setting pada komputer salah<br />Solusi :<br />1. Buka Halaman Pengaturan Regional, Time , and Language (dapat melalui Control Panel)<br />2. Ubah pengaturan Regional ke dalam \"English (United States)<br />3. Settings Keyboard hanya gunakan English(US), jika ada keyboard Indonesia mohon dihapus terlebih dahulu. Pengaturan ini dilakukan melalui \"Text Services and Input languages\"<br /><br /><br /><br /> ', 'range, harga, SUSENAS', 'Kontributor : Seksi IPD Sosial, Seksi IPD Produksi, Seksi IPD Distribusi <br />Sumber : <br />1. Buku Pedoman Pengolahan<br />2. Suplemen Aplikasi Pengolahan<br />3. Kejadian sebelumnya<br /> ', '2017-09-13 08:38:20', '2017-09-13 08:38:20'),
(79, 9, 1, 'sudah instalasi VFPOLEDBSetup.msi di laptop 32 bit tetapi masih belum terdeteksi, dan muncul error \"VFPOLEDB1.0 is not registered on the local Machine\"', 'Penyebab : Login komputer tidak sebagai administrator<br />Solusi : Klik kanan reg_32_vfp.bat atau reg_64_vfp.bat pilih Run As Administrator', 'SUSENAS, VFPOLEDBSetup.msi, VFPOLEDB', 'Kontributor : Seksi IPD Sosial, Seksi IPD Produksi, Seksi IPD Distribusi <br />Sumber : <br /><br />1. Buku Pedoman Pengolahan<br />2. Suplemen Aplikasi Pengolahan<br />3. Kejadian sebelumnya<br /> ', '2017-09-13 08:43:26', '2017-09-13 08:45:48'),
(80, 9, 1, 'Pesan error : \" Could not load file or assembly \'System.Web, Version = 4.000, Culture=neutral, PublicKeyToken = .. \"  (SUSENAS)', 'Penyebab : Belum ada komponen .NetFramework 4.0<br />Solusi : Maka install .NetFramework4.0, installer tersebut sudah disertakan di folder \\Aplikasi\\Ext\\ dengan nama dotNetFx40_Full_x86_x64.exe', 'SUSENAS, .NetFramework, culture, neutral, publickeytoken', 'Kontributor : Seksi IPD Sosial, Seksi IPD Produksi, Seksi IPD Distribusi <br />Sumber : <br />1. Buku Pedoman Pengolahan<br />2. Suplemen Aplikasi Pengolahan<br />3. Kejadian sebelumnya<br /> ', '2017-09-13 09:07:22', '2017-09-13 09:07:22'),
(81, 9, 1, 'Error saat Entri atau aplikasi stopped working (SUSENAS)', 'Penyebab : Belum melakukan import data persiapan di aplikasi server<br />Solusi : <br /><br />1. import data persiapan terlebih dahulu di aplikasi server<br />2. import DSRT di aplikasi client<br /> ', 'SUSENAS, entri, stopped working', 'Kontributor : Seksi IPD Sosial, Seksi IPD Produksi, Seksi IPD Distribusi <br />Sumber : <br />1. Buku Pedoman Pengolahan<br />2. Suplemen Aplikasi Pengolahan<br />3. Kejadian sebelumnya<br /> ', '2017-09-13 09:16:36', '2017-09-13 09:16:36'),
(82, 9, 1, 'SUSENAS: Ketika akan membuka menu Laporan di aplikasi Client ( Progress, Pengecekan, Kabupaten, Propinsi), tiba-tiba aplikasi menjadi not responding atau aplikasi stopped working', 'Penyebab : Belum ada komponen Report Viewer <br />Solusi :<br />1.lnstall Report Viewer 2010 terlebih dahulu<br />2. Install report viewer 2012 <br />3. Install SQLSysClrTypes32<br /><br />Installer tersebut juga berada di folder \\Add Tools\\. Install terlebih dahulu ReportViewer2010.exe lanjut SQLSysClrTypes32.msi, dilanjutkan ReportViewer2012.msi. <br />4. Coba kembali membuka menu Laporan<br /><br /> ', 'susenas, laporan, client, progress, pengecekan, kabupaten, propinsi, not responding, aplikasi, stopped working', 'Kontributor : Seksi IPD Sosial, Seksi IPD Produksi, Seksi IPD Distribusi <br />Sumber : <br />1. Buku Pedoman Pengolahan<br />2. Suplemen Aplikasi Pengolahan<br />3. Kejadian sebelumnya<br /> ', '2017-09-13 09:33:37', '2017-09-13 09:33:37'),
(83, 11, 0, 'Gagal Create File KRM (file kirim)', 'penyebab : data sudah lengkap di-entri dan sesuai dengan aturan range dan konsistensi isian maka file KRM akan terbentuk<br /><br /><br /><br /> ', 'create file, file kirim, KRM', 'kontributor : Seksi IPD Sosial, Seksi IPD Produksi, Seksi IPD Distribusi', '2017-09-13 10:39:03', '2017-09-13 10:39:03');
INSERT INTO `ost_faq` (`faq_id`, `category_id`, `ispublished`, `question`, `answer`, `keywords`, `notes`, `created`, `updated`) VALUES
(84, 14, 1, 'Error impor data persiapan', 'A. Penyebab : Belum melakukan create database :<br /> Solusi : <br /> 1. Buka aplikasi server<br /> 2. Lakukan \"Create database\" pada menu yang telah disediakan<br /><br />b. Penyebab : Database yang dipake telah kadaluwarsa (belum menggunakan versi terbaru)<br /> Solusi :<br /> 1. Lihat versi yang tertera pada aplikasi, pastikan versi aplikasi dan database yang sedang berjalan adalah versi terbaru<br /> 2. Jika versi yang berjalan belum yang terbaru, perbarui aplikasi/database dengan patch terbaru<br /> 3. Lakukan kembali impor master persiapan<br /><br /> ', 'import, data persiapan, database, aplikasi server', 'kontributor : Seksi IPD Sosial, Seksi IPD Produksi, Seksi IPD Distribusi <br /><br />Sumber : <br /><br />1. Buku Pedoman Pengolahan<br />2. Suplemen Aplikasi Pengolahan<br />3. Kejadian sebelumnya<br /> ', '2017-09-13 10:45:00', '2017-09-13 10:45:00'),
(85, 11, 1, 'Salah penerimaan doumen di KTA pada Pengolahan data sensus dengan KTA', 'A. Penyebab : Salah identitas (kode wilayah)<br /> Solusi : <br /> 1. Jika masih pada Proses Pengecekan, ubah No Box Kecil untuk BS yang bersangkutan, agar terpisah dari Box sebelumnya.<br /> 2. Jika ingin job tetap ada di Pengecekan Dokumen, jangan isikan RBL atau Peta pada isian tersebut, dan klik Complete.<br /><br />B. Penyebab :salah input jumlah dok L1 atau L2<br /> Solusi :<br />1. Diperbaiki pada bagian Pengecekan/pemeriksaan kelengkapan dokumen SE2016<br />2. Diperbaiki pada penerimaan dokumen hasil edit dari petugas editor<br /><br />C. Penyebab : Jika terjadi kesalahan alokasi box besar <br /> Solusi : pindah box besar<span><br /><br /></span> ', 'sensus, pengolahan, KTA, penerimaan dokumen', 'Kontributor : Seksi IPD Sosial, Seksi IPD Produksi, Seksi IPD Distribusi <br />Sumber : <br />1. Buku Pedoman Pengolahan<br />2. Suplemen Aplikasi Pengolahan<br />3. Kejadian sebelumnya<br /> ', '2017-09-13 11:32:28', '2017-09-13 11:43:56'),
(86, 14, 1, 'Pengolahan Sensus dengan KTA: Error pada saat create user adminkab (KTA)', 'Penyebab : Hal ini terjadi karena melakukan create database tetapi belum melakukan Delete Job (Job Clear Down) dan Delete Resource<br /><br />Solusi :<br />1. Lakukan Delete Resource secara manual: Masuk Kofax TotalAgility dan Pilih Resource<br />2. Pilih Group Resource yang akan di Delete<br />3. Pilih Resource yang akan di Delete<br />4. Create user selain adminkab, harus dilakukan dengan login adminkab<br /> ', 'sensus,pengolahan, KTA, create user, adminkab', 'Kontributor : Seksi IPD Sosial, Seksi IPD Produksi, Seksi IPD Distribusi <br />Sumber : <br />1. Buku Pedoman Pengolahan<br />2. Suplemen Aplikasi Pengolahan<br />3. Kejadian sebelumnya<br /> ', '2017-09-13 11:47:25', '2017-09-13 11:47:25'),
(87, 14, 1, 'Pengolahan Sensus dengan KTA: Pesan Error:  Database error occurred. Contact your administrator. In the event you require technical assistance please reference action. DBQueryInsertUpdateSipmen.', 'Penyebab : Terdapat beberapa browser penerimaan yang login dengan username yang sama<br />Solusi : <br />1. Tutup semua browser yang akses sipmen<br />2. Restart semua service KTA di local service<br />3. Restart IIS Manager (Control panel -&gt;Administrative Tools -&gt; Internet Information Service (IIS) Manager<br />4. Jika perlu Restart WS-nya. Tunggu WS beberapa saat (jangan langsung digunakan)<br />5. Silakan lakukan kembali Penerimaan Dokumen dengan BS yang baru.<br /><br /> ', 'sensus, KTA, database, DBQueryInsertUpdateSipmen', 'Kontributor: Seksi IPD Sosial, Seksi IPD Produksi, Seksi IPD Distribusi <br />Sumber : <br />1. Buku Pedoman Pengolahan<br />2. Suplemen Aplikasi Pengolahan<br />3. Kejadian sebelumnya<br /> ', '2017-09-13 14:13:13', '2017-09-13 14:13:13'),
(89, 17, 1, 'Tidak dapat login ke filelib', 'Penyebab:<br />Filelib sudah end of support dan sudah diganti dengan laci bps<br /><br />Solusi:<br />1. File lama di filelib masih dapat diunduh dengan mengetikkan <a href=\"http://filelib.bps.go.id/(akun\">http://filelib.bps.go.id/(akun</a> user). Akan tetapi pengguna tidak dapat lagi mengunggah file ke filelib. Penggantinya adalah laci bps<br /> ', 'filelib, laci', 'Kontributor : Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br /><br />Sumber Rujukan :1. Pengalaman sebelumnya;', '2018-01-05 11:33:55', '2018-01-05 11:33:55'),
(90, 19, 1, 'Bandwidth limit exceeded', 'Penyebab:<br />bandwidth yang telah disediakan telah habis digunakan<br /><br />Solusi:<br />1. Eskalasi ke technical support JKD<br /> ', 'web hosting', 'Kontributor: Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber/rujukan : <br />1. Dokumen manual;<br /> ', '2018-01-08 08:28:05', '2018-01-08 08:33:10'),
(91, 18, 1, 'Koneksi ke handkey online terganggu', 'Penyebab:<br />Network Error (tcp_error)<br /><br />Solusi:<br />1. Cek konfigurasi ip, subnet sudah benar<br />2. Cek koneksi ke firewall apakah sudah benar<br />3. Pastikan kabel jaringan yang terhubung ke switch ujungnya menyala (tanda terhubung) <br />4. Instal aplikasi team viewer dan Eskalasi ke technical support agar dapat di-remote.<br /> ', 'laci, filelib, storage', 'Kontributor : Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber / Rujukan : <br />1. Pengalaman sebelumnya;<br /> ', '2018-01-08 08:30:04', '2018-01-08 08:30:04'),
(92, 19, 1, 'Reported Attack Page', 'Penyebab:<br />Script yang membahayakan yang dimiliki oleh beberapa file web. Review dapat dilihat dengan click tombol \"Why was this page blocked?\"<br /><br />Solusi:<br />1. Pastikan PC yang akan digunakan bersih dari virus atau malware<br />2. Selanjutnya Admin Website mendownload semua file websitenya (di folder public_html/) ke local komputer.<br />Kemudian coba scan menggunakan antivirus atau anti malware.<br />3. Untuk script-script yang terindikasi malware, harap di cek apakah script tersebut adalah coding-an sendiri<br />4. jika iya, perbaiki code, jika tidak (kemungkinan besar), maka script tersebut sebaiknya dihapus<br />5. Hindari penggunaan untuk akses page diluar domain tersebut.<br />Contoh script malware:</iframe><br />Coba scan sekali lagi seluruh file websitenya dengan antivirus/malware<br />6. Jika sudah bersih dari virus, hapus seluruh file yang ada di hosting [di folder public_html/]<br />Ubah password CPanel (admin dapat merubah sendiri)<br />7. Upload semua file yang di local komputer ke hosting BPS [di folder public_html/]<br />8. Selanjutnya minta google untuk mereview kembali website tersebut <a href=\"https://support.google.com/webmasters/answer/168328\">https://support.google.com/webmasters/answer/168328</a><br /> ', 'web hosting', 'Kontributor: Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber/rujukan:<br />1. Dokumen manua<span>l<br /></span> ', '2018-01-08 08:31:05', '2018-01-08 08:31:05'),
(93, 18, 1, 'Error pada mesin fingerprint (misalnya : sering berbunyi padahal tidak ada yang melakukan presensi)', 'Penyebab:<br />Kerusakan pada fisik mesin fingerprint karena terkena lonjakan listrik, dsb<br /><br />Solusi:<br />1. Restart mesin handkey<br />2. Eskalasi ke technical support JKD<br /> ', 'laci, filelib, storage', 'Kontributor : Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber / Rujukan : 1. Pengalaman sebelumnya;<br /> ', '2018-01-08 08:34:00', '2018-01-08 08:34:00'),
(94, 19, 1, 'Error displaying the error page: Application Instatiation Error', 'Penyebab:<br />Error displaying the error page: Application Instatiation Error<br /><br />Solusi:<br />1. Konfigurasi database disesuaikan<br />public $dbtype = \'mysql\';<br />public $host = \'localhost\';<br />public $user = [user db];<br />public $password = [password user db];<br />public $db = [nama db]<br /> ', 'web hosting', 'Kontributor: Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber/rujukan:<br />1. Dokumen manual;<br /><br /><br /><br /> ', '2018-01-08 08:38:38', '2018-01-08 08:38:38'),
(95, 19, 1, 'Error log yang berhubungan dengan fungsi eval', 'Penyebab:<br />Web terdeteksi menggunakan fungsi php eval yang beresiko terhadap keamanan web (dimanfaatkan peretas). Fungsi tersebut tidak dapat digunakan lagi<br /><br />Solusi:<br />1. Website yang memanfaatkan fungsi tersebut harus melakukan penyesuaian dengan memanfaatkan fungsi lain pengganti fungsi eval() agar website dapat tampil kembali.<br />2. Ikuti panduan yang tersedia di noc.bps.go.id/blog/solusi-error-use-of-eval-is-forbidden-by-configuration<br />3. Eskalasi ke technical support JKD<br /> ', 'web hosting', 'Kontributor: Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber/rujukan:<br />1. Dokumen manual;', '2018-01-08 08:40:56', '2018-01-08 08:40:56'),
(96, 19, 1, 'This account has been suspended', 'Penyebab:<br />Website tersebut terkena deface/hack dari pihak luar<br /><br />Solusi:<br />1. Menyiapkan file website yang baru , karena pada file web yang lama sudah banyak backdoor yang ditanam peretas.<br />2. Pastikan juga update versi CMS yang anda pakai jika menggunakan CMS seperti joomla, wordpress, drupal , dll.<br />3. Jika sudah siap upload file baru, silahkan menghubungi Subdit JKD, email jkd@bps.go.id untuk membuka kembali akses web.<br />4. Upload file melalui salah satu cara berikut :<br />manajemen cpanel pada url <a href=\"https://namasudbdomain.bps.go.id:2083\">https://namasudbdomain.bps.go.id:2083</a><br />melalui ftp client (disarankan menggunakan winscp) menggunakan<br />host : namasubdomain.bps.go.id.<br />username : bpsxxyy<br />password : sesuai password untuk login cpanel.<br />5. Apabila lupa password dapat menghubungi Sub dit. JKD untuk reset password.<br />6. Seluruh file-file web diletakkan langsung di bawah direktori www atau public_html.<br /> ', 'web hosting', 'Kontributor: Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber/rujukan:<br />1. Dokumen manual;<br /><br /> ', '2018-01-08 08:42:21', '2018-01-08 08:42:21'),
(97, 20, 1, 'Tidak bisa sign in lync/skype for business', 'Penyebab 1:<br />Belum instal sertifikat<br /><br />Solusi 1:<br />1. Masuk ke noc.bps.go.id/blog<br />2. Ketikkan Skype for Business pada tombol pencarian<br />3. Ikut panduan instalasi lync/skype for business dan instalasi sertifikat<br /><br />Penyebab 2:<br />Akun user belum diaktivasi<br /><br />Solusi 2:<br />1. Eskalasi ke technical support JKD untuk aktivasi akun lync<br /> ', 'skype, lync', 'Kontributor: Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber/rujukan:<br />1. Dokumen manual skype for business<span><br /></span> ', '2018-01-08 08:45:56', '2018-01-08 08:45:56'),
(98, 21, 1, 'Tidak dapat akses spool', 'Penyebab:<br />Setting berubah untuk mengantisipasi wannacry<br /><br />Solusi:<br />1. Aktifkan SMB karena kemungkinan fitur SMB telah nonaktif<br />2. Eskalasi ke technical support JKD<br /> ', 'spool, file share, storage', 'Kontributor: Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber/rujukan:<br />1. Pengalaman sebelumnya;<br /> ', '2018-01-08 08:48:09', '2018-01-08 08:48:09'),
(99, 17, 1, 'Tidak dapat upload file ke laci', 'Penyebab:<br />Tidak dapat upload file ke laci<br /><br />Solusi:<br />1. Pastikan kecepatan download dan upload anda stabil (untuk speed test ke server bps <a href=\"http://filelib.bps.go.id/speed\">http://filelib.bps.go.id/speed</a> )<br />untuk laci, <br />2. Bila memang kesulitan upload menggunakan web, silahkan menggunakan aplikasi owncloud desktop, dengan aplikasi desktop tersebut, memungkinkan untuk resume upload. Silahkan klik username dan pilih personal, setelah masuk personal pilih desktop app, akan muncul window baru, pilih desktop client, nah download berdasar sistem operasi yang dipakai di komputer anda<br /> ', 'laci, filelib, storage', 'Kontributor: Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber/rujukan:<br />1. Pengalaman sebelumnya;<span><br /></span> ', '2018-01-08 08:51:05', '2018-01-08 08:51:05'),
(100, 17, 1, 'Tidak dapat membuka laci', 'Penyebab:<br />Muncul error \"This connection is untrusted\"<br /><br />Solusi:<br />1. Clear recent history pada browser Anda<br />2. Eskalasi ke technical support JKD<br /> ', 'laci, filelib, storage', 'Kontributor: Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber/rujukan:<br />1. Pengalaman sebelumnya;', '2018-01-08 08:52:24', '2018-01-08 08:52:24'),
(101, 18, 1, 'Gagal enroll pegawai baru', 'Penyebab:<br />gagal sinkronisasi<br /><br />Solusi:<br />1. Forward ke sim@bps.go.id atau eskalasi ke technical support PTI mengenai SIM<br /><br /> ', 'laci, filelib, storage', 'Kontributor : Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br /><br />Sumber / Rujukan :<br />1. Pengalaman sebelumnya;<span><br /></span> ', '2018-01-08 08:56:08', '2018-01-08 08:56:08'),
(102, 22, 1, 'Gagal login ke s.bps.go.id dengan akun user tertentu', 'Penyebab:<br />Login dengan akun unit kerja<br /><br />Solusi:<br />Login ke s.bps.go.id hanya dapat dilakukan dengan menggunakan akun perorangan, bukan akun unit kerja<br /> ', 'shorten, url', 'Kontributor : Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber / Rujukan :<br />1. Pengalaman sebelumnya;<br /> ', '2018-01-08 08:59:18', '2018-01-08 08:59:18'),
(103, 23, 1, 'Gagal login ke sharepoint', 'Penyebab:<br />belum diketahui penyebabnya<br /><br />Solusi:<br />1. Eskalasi ke technical support JKD<br /> ', 'portal, kolaborasi, sharepoint', 'Kontributor : Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber / Rujukan :<br />1. Pengalaman sebelumnya;<br /> ', '2018-01-08 09:02:45', '2018-01-08 09:02:45'),
(104, 23, 1, 'Gagal menambahkan add-on sharepoint', 'Penyebab:<br />Farm sharepoint masih terus dikembangkan<br /><br />Solusi:<br />1. Eskalasi ke technical support JKD<br /> ', 'laci, filelib, storage', 'Kontributor : Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber / Rujukan :<br />1. Pengalaman sebelumnya;<br /> ', '2018-01-08 09:06:06', '2018-01-08 09:06:06'),
(105, 15, 1, 'Pegawai tidak ada di community / unit kerja pegawai tidak update', 'Penyebab:<br />Data pegawai belum diupdate Kepegawaian<br /><br />Solusi:<br />1. Pastikan bahwa pegawai tersebut dapat login ke email BPS<br />2. Eskalasi permasalahan ke Kepegawaian<br /> ', 'portal, kolaborasi, community', 'Kontributor : Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber / Rujukan :<br />1. Pengalaman sebelumnya;<br /> ', '2018-01-08 09:08:45', '2018-01-08 09:08:45'),
(106, 15, 1, 'Tidak bisa login ke community', 'Penyebab:<br />Pegawai belum didaftarkan alamat emailnya di community atau data pegawai pada Active Directory kurang lengkap<br /><br />Solusi:<br />1. Pastikan bahwa pegawai tersebut dapat login ke email BPS<br />2. Pastikan bahwa pegawai tersebut sudah terdaftar di community dan periksa apakah alamat email pegawai tersebut tampil di community<br />3. Jika pegawai dapat login ke email BPS, tetapi alamat email pegawai tidak tampil di community, eskalasi permintaan ke JKD untuk didaftarkan ke community<br />4. Jika pegawai dapat login ke email BPS dan alamat email pegawai tampil di community, eskalasi permintaan ke JKD untuk pengecekan di Active Directory <br /><br /> ', 'portal, kolaborasi, community', 'Kontributor : Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber / Rujukan :<br />1. Pengalaman sebelumnya;<br /> ', '2018-01-08 09:11:00', '2018-01-08 09:11:00'),
(107, 24, 1, 'Tidak dapat mengakses server hosting tertentu (misalnya http://spkonline.bps.go.id)', 'Penyebab:<br />HTTP Status 404<br /><br />Solusi:<br />1. Eskalasi ke technical support JKD<br /> ', 'server, hosting', 'Kontributor : Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber / Rujukan :<br />1. Pengalaman sebelumnya;<br /> ', '2018-01-08 09:15:14', '2018-01-08 09:15:14'),
(108, 24, 1, 'Minta tambahan kuota untuk server hosting', 'Penyebab:<br />Bandwidth limit exceeded<br /><br />Solusi:<br />1. Eskalasi ke technical support JKD<br />NB:<br />a. Secara default kuota bandwidth setiap website kabupaten adalah 3GB dan direset setiap awal bulan. <br />b. Statistik penggunaan bandwidth secara lebih detail dapat dilihat melalui menu \"Awstat\" di CPanel. <br />c. Mengenai loading time, ada beberapa faktor yang perlu diperhatikan, antara lain koneksi internet, besarnya file website yang diakses, aktivitas yang sedang dilakukan dari dan ke server hosting. Jadi besarnya file publikasi memang berpengaruh terhadap loading time. Jika memungkinkan kompres file sekecil2nya.<br /><br /> ', 'portal, kolaborasi, community', 'Kontributor : Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber / Rujukan :<br />1. Pengalaman sebelumnya;<br /> ', '2018-01-08 09:16:39', '2018-01-08 09:16:39'),
(109, 25, 1, 'Gagal koneksi', 'Penyebab 1:<br />Failed to establish a connection to \'localhost\' di PST<br /><br />Solusi 1:<br />1. Pengguna harap memastikan apakah service postgre masih berjalan atau tidak dengan menggunakan windows service. Jika dalam kondisi tidak aktif, silakan untuk coba start service postgre tersebut.<br />2. Apabila service postgre gagal direstart, coba hapus file berikut C:\\\\Program Files\\Postgre\\8.4\\Data\\postmaster.pid lalu jalankan kembali service postgrenya<br />3. Jika tetap gagal, silakan hubungi tim developer PST di email perpustakaan@bps.go.id untuk tindakan lebih lanjut<br /><br /> ', 'database, hosting', 'Kontributor : Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber / Rujukan :<br />1. Pengalaman sebelumnya;<br /> ', '2018-01-08 09:19:33', '2018-01-08 09:19:33'),
(110, 1, 1, 'Tidak bisa login email.', 'Penyebab 1:<br />User belum memiliki akun email.<br />Solusi 1:<br />1. Cek nama akun (username) email Anda pada Community (community.bps.go.id).<br />2. Apabila rincian \'Email\' pada profile akun Community Anda masih kosong, maka Anda belum memiliki akun email.<br />3. Silakan mengajukan permohonan pembuatan akun email melalui tiket dengan dilampirkan memo yang ditandatangani oleh minimal pejabat Eselon III.<br /><br /><br />Penyebab 2:<br />Kesalahan penulisan username atau password email.<br />Solusi 2:<br />1. Perhatikan apakah fungsi capslock menyala/hidup (penulisan email mengggunakan case sensitive sehingga penulisan huruf besar dan kecil harus dibedakan).<br />2. Username akun email ditulis menggunakan huruf kecil.<br />3. Kesalahan penulisan username atau password pada saat login email hanya ditolerir sebanyak 5 kali, lebih dari itu Anda harus<br />menunggu selama 30 menit sebelum mencoba login kembali.<br />4. Apabila sudah dipastikan username dan password yang dimasukkan benar dan tetap tidak bisa login, Anda dapat mengajukan permohonan untuk mengganti password melalui tiket.<br /><br /><br />Penyebab 3:<br />Email terkunci (lockout).<br />Solusi 3:<br />1. Salah memasukkan username atau password email sebanyak 5 kali berturut-turut akan menyebabkan email terkunci (lockout). Silakan menunggu selama 30 menit sebelum mencoba untuk login kembali.<br />2. Apabila Anda menggunakan aplikasi Email pada Smartphone, silakan dicek apakah username dan password yang digunakan pada Aplikasi sudah sesuai dengan kondisi terbaru. Hal ini dikarenakan smartphone akan mereload terus-menerus menggunakan username atau password lama yang terdaftar, yang menyebabkan akun akan terkunci apabila username dan password yang diload tidak sesuai dengan kondisi sekarang.<br /><br /><br />Penyebab 4:<br />Email ditutup sementara (closed) karena akun email terindikasi melakukan spam.<br />Solusi 4:<br />1. Pengguna diwajibkan menginstal antivirus pada PC yang digunakan jika belum ada antivirus yang terinstal<br />2. Pengguna diwajibkan mengupdate antivirus pada PC yang digunakan jika sudah ada antivirus yang terinstal tetapi belum diupdate<br />3. Pengguna melakukan scan pada PC yang digunakan sehingga bersih dari virus dan malware lainnya<br />4. Pengguna mengajukan permohonan ke Admin melalui tiket untuk mengajukan permohonan pergantian password untuk mengaktifkan kembali email dengan password baru<br /> ', 'email, login, username, password, lockout, closed, spam', 'Kontributor: Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br /><br />Sumber/Rujukan:<br />1. Dokumen manual email;<br />2. Kejadian Sebelumnya.<br /><span><br /><br /></span> ', '2018-01-08 09:29:56', '2018-01-08 09:29:56'),
(111, 1, 1, 'Pengajuan reset (pergantian) password email BPS.', 'Penyebab 1:<br />User lupa password email BPS dan mengajukan pergantian password.<br />Penyebab 2:<br />Password email bocor (diketahui banyak orang) sehingga user ingin mengajukan pergantian password email.<br /><br />Solusi:<br />1. Silakan mengajukan permintaan reset password melalui tiket dengan disertai alamat email alternatif lain untuk dikirimkan password yang baru.<br />2. Admin JKD akan melakukan reset password pada akun email yang bersangkutan (dengan password sementara) dan user dapat melakukan pergantian password sendiri pada saat pertama kali login.<br /> ', 'email, login, reset, password', 'Kontributor: Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br /><span><br />Sumber/Rujukan:<span><br />1. Dokumen manual email;<br />2. Kejadian Sebelumnya.<br /></span></span> ', '2018-01-08 09:33:04', '2018-01-08 09:33:04'),
(112, 1, 1, 'Pengajuan pergantian nama (username) email.', 'Penyebab 1:<br />User mengajukan pergantian alamat (username) email<br /><br /><br />Solusi 1:<br />User dapat mengajukan pergantian alamat (username) email melalui tiket dengan ketentuan penamaan email sebagai berikut:<br />1. Nama tunggal<br /> nama@bps.go.id<br /> Contoh: Miswar akan memiliki alamat email miswar@bps.go.id<br />2. Nama dengan dua suku kata<br /> sukukatapertama.sukukatakedua@bps.go.id<br /> Contoh: Siska Ambarwati akan memiliki alamat email siska.ambarwati@bps.go.id<br />3. Nama duplikat<br /> sukukatapertama.sukukatakedua(n)@bps.go.id. dimana n menyatakan nomor yang belum digunakan.<br /> Contoh: Siska Ambarwati yang kedua akan memiliki alamat email siska.ambarwati2@bps.go.id<br />4. Nama dengan spasi<br /> Spasi akan dihilangkan dan nama akan digabungkan. Ini akan dilakukan baik pada nama depan maupun nama belakang.<br /> Contoh: Hery Al Amin akan memiliki alamat email hery.alamin@bps.go.id<br />5. Nama dengan apostrof (tanda petik) atau tanda baca yang lain<br /> Apostrof atau tanda baca yang lain akan dihilangkan<br /> Contoh: Sadiyah akan memiliki alamat email sadiyah@bps.go.id<br />6. Nama dengan lebih dari dua suku kata<br /> Sukukatapertama.sukukatakedua@bps.go.id atau sukukatapertama.sukukataterakhir@bps.go.id<br /> Contoh: Ahmad Hartiono Utomo akan memiliki email ahmad.hartiono@bps.go.id atau ahmad.utomo@bps.go.id bila<br /> email pertama sudah terpakai<br />7. Nama dengan gelar<br /> Gelar dihilangkan dan hanya digunakan nama resminya<br /> Contoh: Dr. Indria Sasmita akan memiliki email indria.sasmita@bps.go.id<br /> RA. Asih Sulistiowati akan memiliki email asih.sulistiowati@bps.go.id<br />9. Nama Panggilan<br /> Nama panggilan tidak lagi diperkenankan sebagai alamat email<br /> Contoh: Handi Priyadi lebih dikenal dengan nama panggilan Jebot. Maka, email yang diberikan tetap handi.priyadi@bps.go.id<br />Permintaan penggantian alamat email dapat dilakukan untuk hal-hal berikut :<br />1. Admin salah membuatkan nama email<br />2. Penamaan email mencirikan kesalahan gender (Pemilik email laki-laki tapi diberikan nama akun perempuan atau sebaliknya)<br />3. Nama akun terdengar porno/tidak pantas pada bahasa tertentu<br />4. Jika dilakukan penggantian username email, maka pengguna disarankan membackup file di layanan laci-nya dikarenakan akun laci yang lama tidak akan bisa diakses lagi setelah username diganti<br /><br /> ', 'email, login, username, nama', 'Kontributor: Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br /><span><br />Sumber/Rujukan:<span><br />1. Dokumen manual email;<br />2. Kejadian Sebelumnya.<strong><i><span style=\"text-decoration:underline\"><sub><sup><del><br /></del></sup></sub></span></i></strong><br /></span></span> ', '2018-01-08 09:36:48', '2018-01-08 09:36:48'),
(113, 1, 0, 'Kuota email telah penuh.', 'Penyebab 1:<br />Email yang masuk ke alamat email pengguna telah mencapai batas kuota yang ditetapkan (1.25 GB).<br /><br />Solusi 1:<br />1. Hapus email-email yang menurut Anda sudah tidak penting.<br />2. Email-email yang telah dihapus akan masuk ke folder \'Trash\' dan masih memakan kuota dari email. Kosongkan folder \'Trash\' agar tidak memenuhi kuota email Anda, dengan cara klik kanan lalu pilih \'Empty Trash\'.<br /><br />Solusi 2:<br />Anda dapat menyimpan di komputer lokal untuk email-email penting melalui Zimbra Desktop. Panduan menggunakan Zimbra Desktop dapat diunduh pada link berikut: <a href=\"https://community.bps.go.id/portal/files/Panduan_Backup_ke_Zimbra_Desktop.pdf\">https://community.bps.go.id/portal/files/Panduan_Backup_ke_Zimbra_Desktop.pdf</a><br /><br />User dapat mengajukan penambahan kuota email baik untuk email pribadi maupun unit kerja, dengan ketentuan: <br />a. Email pribadi : Kuota yang diberikan untuk email pribadi adalah 1.25 GB. Penambahan kuota sementara hanya diberikan untuk hal-hal yang bersifat urgensi, seperti misalnya kebutuhan untuk mengirim/menerima email dalam jumlah besar.<br />b. Email unit kerja : Kuota yang diberikan untuk email unit kerja adalah 1.25 GB. Penambahan kuota dapat diberikan secara bertahap tergantung kebutuhan unit kerja hingga maksimal 4 GB.<br />Permintaan penambahan kuota email harus disertai memo minimal pejabat eselon III.<br /> ', 'email, kuota', 'Kontributor: Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br /><br />Sumber/Rujukan:<br />1. Dokumen manual email;<br />2. Kejadian Sebelumnya.<strong><i><span style=\"text-decoration:underline\"><sub><sup><del><br /></del></sup></sub></span></i></strong> ', '2018-01-08 09:39:01', '2018-02-07 16:35:10'),
(114, 1, 1, 'Email yang dikirimkan ke domain @bps.go.id tidak sampai.', 'Penyebab 1:<br />Kuota email dari si pengirim email telah penuh.<br />Solusi 1:<br />1. Cek kuota dari si pengirim email, dengan cara mengarahkan kursor ke \'nama Anda\' disebelah pojok kanan atas tampilan email. <br />2. Lakukan penghapusan pada email-email yang sudah tidak digunakan lagi.<br />3. Sebelum di hapus, Anda dapat melakukan back-up untuk email-email yang dirasa penting melalui Zimbra Desktop. Panduan dapat diunduh pada link berikut:<br /><a href=\"https://community.bps.go.id/portal/files/Panduan_Backup_ke_Zimbra_Desktop.pdf\">https://community.bps.go.id/portal/files/Panduan_Backup_ke_Zimbra_Desktop.pdf</a><br />3. Email-email yang telah dihapus akan masuk ke folder \'Trash\' dan masih memakan kuota dari email. Kosongkan folder \'Trash\' agar tidak memenuhi kuota email Anda, dengan cara klik kanan lalu pilih \'Empty Trash\'.<br /><br /><br />Penyebab 2:<br />Kuota email dari si penerima email telah penuh.<br />Solusi 2:<br />1. Setelah menghapus beberapa email atau mengosongkan kuota email pada si penerima, silakan menunggu beberapa saat agar email-email yang tertunda mulai masuk ke Inbox si penerima email.<br />2. Email yang dapat masuk ke inbox penerima email hanyalah email-email yang dikirim kurang dari 3 hari yang lalu sejak si penerima mengosongkan kuota emailnya.<br /><br /><br />Penyebab 3:<br />Akun email si penerima sementara di close oleh admin JKD karena terkena spam atau virus.<br />Solusi 3:<br />1. Akun email yang diclose oleh admin JKD tidak dapat menerima email untuk sementara waktu.<br />2. Apabila dalam 3 hari sejak email dikirimkan akun penerima masih dalam status close, maka email yang dikirimkan tidak akan masuk ke kedalam inbox (kotak masuk) email si penerima.<br />3. Silakan menunggu sampai akun penerima diaktifkan kembali oleh admin JKD.<br /><br /><br />Penyebab 4:<br />Terdapat filter pada email si penerima yang membuat email-email yang mengandung kata tertentu di tolak atau langsung di hapus oleh email si penerima<br />Solusi 4:<br />1. Cek kembali filter pada si penerima email (pada menu Preferences &gt; Filters)<br /><br /><br />Penyebab 5:<br />Email masuk ke folder Junk karena dianggap spam.<br />Solusi 5:<br />1. Cek folder Junk pada email penerima.<br /><br /><br />Penyebab 6:<br />Kesalahan setting/konfigurasi Zimbra Destop pada email si penerima, yang mengakibatkan email baru akan langsung dihapus setelah didownload oleh Zimbra Desktop.<br />Solusi 6:<br />1. Cek kembali konfigurasi Zimbra Desktop pada email si penerima.<br />2. Silakan ikuti panduan Back Up Email Melalui Zimbra Desktop pada link berikut untuk memastikan konfigurasi yang digunakan sudah sesuai:<br /><a href=\"https://community.bps.go.id/portal/files/Panduan_Backup_ke_Zimbra_Desktop.pdf\">https://community.bps.go.id/portal/files/Panduan_Backup_ke_Zimbra_Desktop.pdf</a><br /> ', 'email, kuota, ', 'Kontributor: Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br /><br />Sumber/Rujukan:<br />1. Dokumen manual email;<br />2. Kejadian Sebelumnya.<br /> ', '2018-01-08 09:44:12', '2018-01-08 09:44:12'),
(115, 1, 1, 'Terdapat email dari Administrator yang memberikan peringatan perihal kuota email yang sudah penuh dan meminta username dan password untuk proses maintenance.', 'Penyebab 1:<br />Email penipuan (phising) yang ditujukan untuk mengambil alih akun email dari si korban.<br /><br />Solusi 1:<br />1. Agar berhati-hati terhadap email yang mengatas namakan Admin/Administrator dan meminta info mengenai username dan password, karena hal tersebut kemungkinan besar adalah phising yang dilakukan oleh virus.<br />2. Subdit Jaringan Komunikasi Data (JKD) tidak pernah mengirimkan email yang meminta username dan password dari akun email pegawai BPS.<br /> ', 'email, username, password, phising, virus, administrator, penipuan', 'Kontributor: Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br /><span><br />Sumber/Rujukan:<span><br />1. Dokumen manual email;<br />2. Kejadian Sebelumnya.<strong><i><span style=\"text-decoration:underline\"><sub><sup><del><br /></del></sup></sub></span></i></strong><br /></span></span> ', '2018-01-08 09:46:16', '2018-01-08 09:46:16'),
(116, 1, 1, 'Pada folder SENT terdapat pengiriman email ke banyak alamat email, tapi bukan saya yang mengirimkan.', 'Penyebab 1:<br />Email terinfeksi virus.<br /><br />Solusi 1:<br />1. Pengguna diwajibkan menginstal antivirus pada PC yang digunakan jika belum ada antivirus yang terinstal<br />2. Pengguna diwajibkan mengupdate antivirus pada PC yang digunakan jika sudah ada antivirus yang terinstal tetapi belum diupdate<br />3. Pengguna melakukan scan pada PC yang digunakan sehingga bersih dari virus dan malware lainnya<br />4. Pengguna mengajukan permohonan ke Admin melalui tiket untuk mengajukan permohonan pergantian password untuk mengaktifkan kembali email dengan password baru<br /> ', 'email, virus', 'Kontributor: Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br /><span><br />Sumber/Rujukan:<span><br />1. Dokumen manual email;<br />2. Kejadian Sebelumnya.<strong><i><span style=\"text-decoration:underline\"><sub><sup><del><br /></del></sup></sub></span></i></strong><br /></span></span> ', '2018-01-08 09:50:44', '2018-01-08 09:50:44'),
(117, 1, 0, 'Akun email pegawai BPS yang telah meninggal/pensiun tidak dapat dibuka.', 'Penyebab 1:<br />Akun email pegawai BPS yang telah pensiun akan dinonaktifkan oleh admin JKD dalam waktu 3 bulan sejak tanggal pension.<br />Solusi 1:<br />1. User yang telah memasuki masa pensiun/purnabakti akan diberikan waktu selama 3 bulan sejak tanggal pensiun untuk memindahkan/membackup email-email yang dianggap penting. Setelah itu, akun akan di non-aktifkan.<br />2. Apabila user ingin melihat kembali email setelah di nonaktifkan, silakan menghubungi Subdit JKD melalui tiket.<br /><br /><br />Penyebab 2:<br />Akun email pegawai BPS yang telah meninggal akan langsung dinonaktifkan oleh admin JKD.<br />Solusi 2:<br />1. Pegawai lain yang ingin melihat kembali akun email pegawai yang telah dinonaktifkan, silakan menghubungi Subdit JKD melalui tiket dengan dilampirkan memo minimal pejabat Eselon III.<br /> ', 'email, pensiun, meninggal', 'Kontributor: Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br /><span><br />Sumber/Rujukan:<span><br />1. Dokumen manual email;<br />2. Kejadian Sebelumnya.<strong><i><span style=\"text-decoration:underline\"><sub><sup><del><br /></del></sup></sub></span></i></strong><br /></span></span> ', '2018-01-08 09:53:38', '2018-01-08 09:53:38'),
(118, 16, 1, 'Tidak dapat terkoneksi jaringan LAN dan Internet', 'Penyebab 1:<br />Kabel UTP belum terpasang.<br />Solusi 1:<br />1. Cek apakah kabel jaringan terhubung komputer<br />2. Apakah ada indikator kedip lampu dikonektor kabel utp di pc<br />3. apakah perangkat switch diruangan hidup.<br />4. Cek apakah kabel sudah terhubung sempurna ke switch dengan cara mengganti kabel tersebut ke port lain di switch. Jika lampu switch berkedip berarti ada hubungan ke switch pada port yang bersangkutan<br />5. Ganti kabel jaringan dengan cara pinjam kabel di komputer lain <br />6. Jika tetap tidak bisa sementara komputer yang lain jalan makan kemungkinan adapternya rusak, maka eskalasi ke technical support JKD<br /><br />Penyebab 2:<br />Konfigurasi Perangkat PC atau Notebook belum terkonfigurasi<br />Solusi 2:<br />1. apakah ip address dan dns sudah diisi sesuai nomenkelatur .<br />2.Melihat panduan penggunaan Konfigurasi Jaringan BPS<br /><br /><br />Penyebab 3:<br />PC/komputer terkena operating sistem bermasalah<br />Solusi 3:<br />1.Komputer terkena virus dan harus di install antivirus<br />2.harus install operating sistem baru<br /><br /><br />Penyebab 4:<br />PC/komputer terhubung dengan jaringan BPS akan tetapi tidak bisa akses internet<br />Solusi 4:<br />1. Pastikan terlebih dahulu dengan membuka browser internet kita dan check ke website tertentu misal saja ke <a href=\"http://www.detik.com\">www.detik.com</a> atau www.google.com. <br />2. Lepaskan sambungan kabel UTP (kabel jaringan LAN BPS), tunggu beberapa saat kemudian sambung lagi.<br />3. Restart komputer anda dan ulangi untuk membuka dan akses website. 4. Jika anda bisa mengakses website akan tetapi koneksinya lambat sekali sementara komputer lain bisa mengakses (jika ada lebih dari dua komputer dalam jaringan) anda bisa mencurigai beberapa komputer yang lain sedang mengkonsumsi bandwidth sangat intensive atau banyak melakukan sharing files dengan beberapa komputer. <br />5. Ketikan internet.bps.go.id pada browser internet, kemudian masukkan username dan password email bps anda.<br /><br /><br />Penyebab 5:<br />Limited atau no connectivity<br />Solusi 5:<br />1. Klik kanan adapter jaringan dan pilih repair.<br />2. Pastikan konfigurasi TCP/IP sudah benar<br />3. Setting proxy browser dengan 10.0.0.94 port 3128 atau ke link <a href=\"http://proxy.bps.go.id\">http://proxy.bps.go.id</a><br />4. Restart komputer anda<br />5. Jika masih status limited, eskalasi ke technical support JKD<br /><br /> ', 'lan, akses, internet, wifi', 'Kontributor: Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br /><span><br />Sumber/Rujukan:<span><br />1. Dokumen manual noc;<br />2. Kejadian Sebelumnya.<strong><i><span style=\"text-decoration:underline\"><sub><sup><del><br /></del></sup></sub></span></i></strong><br /></span></span> ', '2018-01-08 10:01:12', '2018-01-08 10:01:12'),
(119, 16, 1, 'Tidak dapat akses ke wifi BPSHQ', 'Penyebab 1:<br />Signal lemah/tidak ditemukan<br />Solusi 1:<br />1.Fitur wifi di Notebook/smartphone belum di aktifkan. <br />2.Lebih mendekat kearah perangkat akses point.<br />3.Cek apakah ada indikator hidup di akses point di lantai tersebut<br />4. Jika sebelumnya sudah diaktifkan, maka reconnect ke wifi tersebut (refresh)<br /><br /><br />Penyebab 2:<br />Tidak dapat Login<br />Solusi 2:<br />1.user name atau password salah<br />2.gunakan user dan password akun email tanpa (@.bps.go.id)<br /><br /><br />Penyebab 3:<br />Belum terinstall software agen wifi<br />Solusi 3:<br />1.konek terlebih dahulu ke SSID BPS Guest<br />2.Membaca manual penggunaan koneksi wifi BPS Guest<br /><br /><br />Penyebab 4:<br />NIC atau wireless adapter status disable<br />Solusi 4:<br />1. Enable-kan wireless adapter<br /> ', 'wifi, akses, internet', 'Kontributor: Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br /><span><br />Sumber/Rujukan:<span><br />1. Dokumen manual noc;<br />2. Kejadian Sebelumnya.<strong><i><span style=\"text-decoration:underline\"><sub><sup><del><br /></del></sup></sub></span></i></strong><br /></span></span> ', '2018-01-08 10:03:48', '2018-01-08 10:03:48'),
(120, 26, 1, 'Tidak dapat terkoneksi dengan VPN Site Ke BPS Pusat', 'Penyebab 1:<br />Perangkat pendukung ada yang tidak/belum di aktifkan<br /><br />Solusi 1:<br />1. Pastikan Modem dan Router ISP sudah aktif.<br />2. Perangkat Switch utama aktik<br />3. Perangkat Firewall NSA 2600 aktif<br />4.Switch yang langsung menghubungkan PC ke jaringan VPN<br /><br />Penyebab 2:<br />Konfigurasi Perangkat PC atau Notebook belum terkonfigurasi<br /><br />Solusi 2:<br />1. apakah ip address dan dns sudah diisi sesuai nomenkelatur PC yang akan konek ek jalaur VPN<br />2. Melihat panduan penggunaan Konfigurasi Jaringan VPN<br /><br />Penyebab 3:<br />ISP VPN Mengalami Gangguan Koneksi<br /><br />Solusi 3:<br />1.Test koneksi dari LAN Internal ke gateway vpn ( Ping 10.pp.254.254 )<br />2. Hubungi Hotline engginer onsite BPS atau teknisi JKD<br /> ', 'vpn site', 'Kontributor:<br />Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber Rujukan:<br />1. Dokumen manual VPN<br />2. Kejadian Sebelumnya.<br /> ', '2018-01-08 10:15:17', '2018-01-08 10:15:17'),
(121, 27, 1, 'Tidak dapat terkoneksi atau  lambat koneksi VSAT', 'Penyebab 1:<br />Perangkat pendukung ada yang tidak/belum di aktifkan<br /><br />Solusi 1:<br />1. Pastikan Modem dan Router ISP Vsat sudah aktif.<br />2. Perangkat Switch utama aktik<br />3. Perangkat Firewall sonicwall TZ300 sudah aktif<br />4. Switch yang langsung menghubungkan PC ke jaringan Vsat sudah Aktif<br /><br />Penyebab 2:<br />Konfigurasi Perangkat PC atau Notebook belum terkonfigurasi<br /><br />Solusi 2:<br />1. apakah ip address dan dns sudah diisi sesuai nomenkelatur PC yang akan konek Vsat<br />2. Melihat panduan penggunaan Konfigurasi Jaringan Vsat<br /><br />Penyebab 3:<br />ISP Vsat Mengalami Gangguan Koneksi<br /><br />Solusi 3:<br />1. Test koneksi dari LAN Internal ke gateway vpn ( Ping 10.pp.254.254 )<br />2. Hubungi teknisi JKD dan teknisi vsat<br /><br />Penyebab 4:<br />Koneksi sangat lambat terkesan mati.<br /><br />Solusi 4:<br />1. Pastikan hanya 3 PC saja yang terkoneksi jalur Vsat.<br />2. Akses speedtest.net pastikan sesuai bandwith yang di informasikan BPS Pusat.<br /> ', 'vsat', 'Kontributor:<br />Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber/Rujukan:<br />1. Dokumen manual Vsat.<br />2. Kejadian Sebelumnya.<br /> ', '2018-01-08 10:21:16', '2018-01-08 10:21:16'),
(122, 28, 1, 'Tidak dapat upload data', 'Penyebab 1:<br />Kabel UTP belum terpasang.<br /><br />Solusi 1:<br />1. Cek apakah kabel jaringan terhubung komputer<br />2. Apakah ada indikator kedip lampu dikonektor kabel utp di pc<br />3. Pastikan perangkat switch diruangan hidup.<br /><br />Penyebab 2:<br />Konfigurasi Perangkat PC atau Notebook belum terkonfigurasi<br /><br />Solusi 2:<br />1. apakah ip address dan dns sudah diisi sesuai nomenkelatur PC yang sudah ditentukan<br />2. Melihat panduan penggunaan Konfigurasi Jaringan BPS<br /><br />Penyebab 3:<br />Aplikasi atau web service tidak dapat di akses.<br /><br />Solusi 3:<br />1. Setting port dan IP sesuai dengan manual pertukaran data.<br />2. Pastikan user dan password benar<br /> ', 'ekstranet data, eksternal', 'Kontributor:<br />Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber/Rujukan:<br />1. Dokumen manual Pertukaran Data<br />2. Kejadian Sebelumnya.<br /> ', '2018-01-08 10:25:20', '2018-01-08 10:25:20'),
(123, 29, 1, 'Tidak dapat terkonek  Personal VPN', 'Penyebab 1:<br />Tidak dapat terkoneksi dengan vpn.bps.go.id<br /><br />Solusi 1:<br />1. Pastikan memiliki akses internet baik melalui modem atau konelsi lainnya misal ( telkom speedy, firstmedia )<br />2. coba akses web ke vpn.bps.go.id<br /><br />Penyebab 2:<br />Tidak dapat akses vpn personal<br /><br />Solusi 2:<br />1. Pastikan akun username dan password sesuai dengan login email<br />2. Install software vpn personal akses domain vpn.bps.go.id<br /> ', 'vpn personal', 'Kontributor:<br />Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber/Rujukan:<br />1. Dokumen manual penggunaan VPN Personal<br />2. Kejadian Sebelumnya.<br /> ', '2018-01-08 10:28:38', '2018-01-08 10:28:38'),
(124, 29, 1, 'Tidak sesuai akses PC/Server yang dinginkan', 'Penyebab 1:<br />Tidak dapat akses ke IP PC/Server<br /><br />Solusi 1:<br />1. PC/Server yang akan di remote dalam kondisi hidup<br />2. Memiliki akses ke PC/Server<br /><br />Penyebab 2:<br />Operating Sistem atau browser tidak di support<br /><br />Solusi 2:<br />1. Pastikan Operating system minimal windows 7<br />2. Browser minimal IE<br /> ', 'vpn personal', 'Kontributor:<br />Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber/Rujukan:<br />1. Dokumen manual Dokumen manual penggunaan VPN Personal.<br />2. Kejadian Sebelumnya.<br /> ', '2018-01-08 10:31:04', '2018-01-08 10:31:04'),
(125, 30, 1, 'Perangkat VOIP tidak Berfungsi', 'Penyebab 1:<br />Perangkat belum aktif/hidup<br /><br />Solusi 1:<br />1. Adaptor tidak terkoneksi dengan power listrik.<br />2. Adaptor tidak berfungsi<br /><br />Penyebab 2:<br />Display perangkat tidak ada indikator keterangan identitas perangkat dan lain lain<br /><br />Solusi 2:<br />1. Perangkat dikonfigurasi jaringan sesuai dengan nomenklatur ip Voip BPS.<br /><br />Penyebab 3:<br />Perangkat voip di display terdapat pesan image downloading field<br /><br />Solusi 3:<br />1. Update firmware perangkat voip hubungi teknisi JKD<br /> ', 'voip', 'Kontributor:<br />Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber/Rujukan:<br />1. Dokumen manual VOIP<br />2. Kejadian Sebelumnya.<br /> ', '2018-01-08 10:34:06', '2018-01-08 10:34:06'),
(128, 31, 1, 'Perangkat Endpoint tidak  aktif/terhubung', 'Penyebab 1:<br />Perangkat belum aktif/hidup<br /><br />Solusi 1:<br />1. Adaptor tidak terkoneksi dengan power listrik.<br />2. Adaptor tidak berfungsi<br /><br />Penyebab 2:<br />Perangkat tidak dapat konek ataupun di call dari pusat<br /><br />Solusi 2:<br />1. Perangkat endpoint belum dikonfigurasi jaringan sesuai dengan nomenklatur ip perangkat Vicon<br />2. restart terlebih dahulu<br /> ', 'vicon', 'Kontributor:<br />Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber/Rujukan:<br />1. Dokumen manual VICON<br />2. Kejadian Sebelumnya.<br /> ', '2018-01-08 10:43:27', '2018-01-08 10:43:27'),
(129, 31, 1, 'Vicon tidak berfungsi baik', 'Penyebab 1:<br />Perangkat vicon dan vpn bermasalah<br /><br />Solusi 1:<br />1. Gunakan fasilitas Conferens Me<br />2. Masuk ke 203.123.60.147 (bila menggunakan ip speedy atau koneksi selain VPN) <br />3. Masukan username dan password (silakan hubungi subdit jkd untuk mendapatkannya)<br />4. Pilih Conferences<br />5. Pilih conferenceMe pada salah satu room conference<br />6. Bila belum terinstall silakan pilih click here to install<br />7. Untuk instalasi, setelah memilih click here to install akan ada pop up, silakan pilih Save File<br />8. Setelah proses download selesai silakan jalankan program yang telah diunduh<br />9. Centang pop up accept dan kemudian pilih instal<br />10. Setelah instalasi selesai, silakan pilih click here to join the conference using Conference-Me<br />11. Akan keluar pop up launch application, pilih conference-Me, kemudian pilih OK<br />12. Program conference-Me akan terbuka dan menghubungkan laptop/komputer yang digunakan dengan server vicon<br /><br />Penyebab 2:<br />Perangkat vicon bermasalah<br /><br />Solusi 2:<br />1. Gunakan fasilitas Conferens Me<br />2. Masuk ke 10.0.0.147 (bila menggunakan koneksi VPN) <br />3. Masukan username dan password (silakan hubungi subdit jkd untuk mendapatkannya)<br />4. Pilih Conferences<br />5. Pilih conferenceMe pada salah satu room conference<br />6. Bila belum terinstall silakan pilih click here to install<br />7. Untuk instalasi, setelah memilih click here to install akan ada pop up, silakan pilih Save File<br />8. Setelah proses download selesai silakan jalankan program yang telah diunduh<br />9. Centang pop up accept dan kemudian pilih instal<br />10. Setelah instalasi selesai, silakan pilih click here to join the conference using Conference-Me<br />11. Akan keluar pop up launch application, pilih conference-Me, kemudian pilih OK<br />12. Program conference-Me akan terbuka dan menghubungkan laptop/komputer yang digunakan dengan server vicon<br /> ', 'vicon', 'Kontributor:<br />Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber/Rujukan:<br />1. Dokumen manual vicon<br /> ', '2018-01-08 10:45:20', '2018-01-08 10:45:20'),
(130, 19, 1, 'Web Hosting tidak dapat akses', 'Penyebab 1:<br />Bandwith exided limeted<br /><br />Solusi 1:<br />1. Eskalasi ke technical support JKD<br /><br />Penyebab 2:<br />Bloking Firewall<br /><br />Solusi 2:<br />1. Kontak admin web hosting untuk membuka akses untuk ip yang sudah di pastikan confirm aman.<br /> ', 'web hosting', 'Kontributor:<br />Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber/Rujukan:<br />1. Dokumen manual<br /> ', '2018-01-08 10:47:40', '2018-01-08 10:47:40'),
(131, 19, 1, 'Tidak dapat login ke management web Hosting', 'Penyebab 1:<br />User atau password tidak dikenal<br /><br />Solusi 1:<br />1. Kontak admin web hosting jaringan untuk reset password akun<br /><br />Penyebab 2:<br />Tidak dapat terkoneksi Management web<br /><br />Solusi 2:<br />1. menggunakan koneksi vpn site atau personal vpn<br /> ', 'web hosting', 'Kontributor:<br />Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber/Rujukan:<br />1. Dokumen manual<br /> ', '2018-01-08 10:49:55', '2018-01-08 10:49:55'),
(132, 25, 1, 'Gagal backup data', 'Penyebab:<br />Backup Restore has stopped working<br /><br />Solusi:<br />1. Untuk kasus tersebut, versi terakhir dari database masih belum support proses backup restore di windows 7 64 bit. Untuk lebih jelasnya, pengguna dapat langsung menghubungi ke tim pst di perpustakaan@bps.go.id<br /> ', 'database, hosting', 'Kontributor:<br />Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber/Rujukan:<br />1. Pengalaman sebelumnya;', '2018-01-08 10:59:12', '2018-01-08 11:11:52'),
(133, 12, 1, 'Gagal koneksi ke server', 'Penyebab 2:<br />Critical error: could not connect to server<br /><br />Solusi 2:<br />1. Eskalasi ke technical support JKD<br /> ', 'server', 'Kontributor:<br />Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber/Rujukan:<br />1. Pengalaman sebelumnya;<br /> ', '2018-01-08 11:04:01', '2018-01-08 11:12:38'),
(134, 12, 1, 'Server Error', 'Penyebab 1:<br /> PCI1360 Bus fatal error on slot 6. Reseat PCI card.<br /><br />Solusi 1:<br />1. silahkan mencabut PCIe yang berada di slot no. 6 lalu memasangnya kembali. Setelah dipasang, seharusnya sudah tidak terjadi error tsb.<br /><br />Penyebab 2:<br /> PCI1318 fatal error on bus 3 device 0 function 1. Power cycle system<br /><br />Solusi 2:<br />1. Pengguna harap mengatur IP iDRAC agar dapat dilakukan remote via VPN melalui firewall BPS Kabupaten/Kota dan menginformasikan IP iDRAC ke technical support JKD<br />2. Eskalasi ke technical support<br /> ', 'server', 'Kontributor:<br />Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber/Rujukan:<br />1. Pengalaman sebelumnya;<br /> ', '2018-01-08 11:08:03', '2018-01-08 11:13:03'),
(135, 32, 1, 'Akses internet ke eksternal tidak bisa setelah melakukan setting firewall', 'Penyebab:<br />1. Topologi jaringan di BPS Kab/Kota tidak sesuai dengan yang diberikan oleh JKD<br />2. Port pada modem internet/hub/switch masih tertutup<br />3. Kabel UTP dalam keadaan rusak<br />4. Konfigurasi port pada firewall tidak sesuai<br /><br />Solusi:<br />1. Pengguna harap menyediakan laptop yang terkoneksi dengan internal, dan melakukan instalasi teamviewer<br />2. Eskalasi ke technical support JKD agar dapat dilakukan remote pc menggunakan teamviewer<br /> ', 'firewall, koneksi', 'Kontributor:<br />Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber/Rujukan:<br />1. Pengalaman sebelumnya;<br /> ', '2018-01-08 11:15:26', '2018-01-08 11:15:26'),
(136, 32, 1, 'Akses internet lancar tapi tidak dapat terhubung ke jaringan BPS', 'Penyebab:<br />1. Fitur VPN Site-to-Site di BPS Kab/Kota dinonaktifkan<br />2. Konfigurasi VPN di BPS Kab/Kota tidak sesuai<br />3. Terdapat permasalahan oleh provider ISP<br /><br />Solusi:<br />1. Pengguna harap menyediakan laptop yang terkoneksi dengan internal, dan melakukan instalasi teamviewer<br />2. Eskalasi ke technical support JKD agar dapat dilakukan remote pc menggunakan teamviewer<br /> ', 'firewall, koneksi', 'Kontributor:<br />Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber/Rujukan:<br />1. Pengalaman sebelumnya;<br /> ', '2018-01-08 11:17:52', '2018-01-08 11:17:52'),
(137, 32, 1, 'Power, lampu lan dan lampu wan menyala, tetapi ketika kabel lan dihubungkan ke port x0, x1 tidak ada respon, portnya tidak berfungsi', 'Penyebab:<br />Port-port yang ada pada firewall mengalami kerusakan<br /><br />Solusi:<br />1. Pengguna harap menginformasikan nomor service tagnya<br />2. Eskalasi ke technical support JKD<br /> ', 'firewall, koneksi', 'Kontributor:<br />Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber/Rujukan:<br />1. Pengalaman sebelumnya;<br /> ', '2018-01-08 11:19:19', '2018-01-08 11:19:19');
INSERT INTO `ost_faq` (`faq_id`, `category_id`, `ispublished`, `question`, `answer`, `keywords`, `notes`, `created`, `updated`) VALUES
(138, 33, 1, 'Gagal koneksi ke wi-fi tertentu', 'Penyebab:<br />PC/laptop sudah terhubung terlalu lama dengan wifi<br /><br />Solusi:<br />1. Refresh koneksi wi-fi dengan menonaktifkan terlebih dahulu dan mengaktifkan lagi<br /> ', 'access point', 'Kontributor:<br />Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber/Rujukan:<br />1. Pengalaman sebelumnya;<br /> ', '2018-01-08 11:22:35', '2018-01-08 11:22:35'),
(139, 33, 1, 'WAN menggunakan setting DHCP dan seringkali mati hidup', 'Penyebab:<br />Jangkauan access point Sonicwall TZ-300W yang kurang kuat.<br /><br />Solusi:<br />IP Address WAN DHCP telah kami ubah ke IP Static, detailnya Bapak/Ibu bisa lihat di konfigurasi Sonicwall pada menu Network-Interface. Konfigurasi Radio Mode pada Sonicwall diubah ke 2.4 Ghz.<br /> ', 'access point', 'Kontributor:<br />Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber/Rujukan:<br />1. Pengalaman sebelumnya;<span><br /></span><br /> ', '2018-01-08 11:25:19', '2018-01-08 11:25:19'),
(140, 33, 1, 'Server hanya mendapat akses jaringan lokal dan tidak mendapat akses internet (sebelumnya sudah dibuatkan IP Static dalam menu admin SonicWall, yaitu 10.153.13.20) (sama dengan KB-JKD-41)', 'Penyebab:<br />Kabel dari X0 yang connect ke port pertama switch Dell<br /><br />Solusi:<br />reconnect kabel dan berhasil<br /> ', 'access point', 'Kontributor:<br />Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber/Rujukan:<br />1. Pengalaman sebelumnya;<br /> ', '2018-01-08 11:27:41', '2018-01-08 11:27:41'),
(141, 33, 1, 'Jaringan Wireless tidak dapat melakukan Ping pada jaringan kabel (PC).', 'Penyebab:<br />Access rules WAN to LAN pada Sonicwall statusnya DENY.<br /><br />Solusi:<br />Ubah access rules WAN to LAN ke ALLOW.<br /> ', NULL, 'Kontributor:<br />Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber/Rujukan:<br />1. Pengalaman sebelumnya;<br /> ', '2018-01-08 11:29:33', '2018-01-08 11:29:33'),
(142, 34, 1, 'Power On, tetapi ketika kabel LAN dicolokkan tidak ada respon', 'Penyebab: <br />Ada kemungkinan switch/kabel mengalami kerusakan<br /><br />Solusi:<br />1. Ganti kabel UTP. <br />2. Pengguna harap menginformasikan nomor service tag dari switch<br />3. Eskalasi ke technical support JKD<br /> ', 'switch', 'Kontributor:<br />Seksi Layanan Jaringan Komunikasi Data, Subdit JKD<br /><br />Sumber/Rujukan:<br />1. Pengalaman sebelumnya;', '2018-01-08 11:32:22', '2018-01-08 11:32:22'),
(143, 2, 1, 'UPS berbunyi', 'Penyebab : UPS tidak mendapat arus listrik<br />Solusi : Periksa kabel power UPS apakah sudah dicolokkan ke stop kontak. kencangkan sambungan kabel power ke UPS dan pastikan UPS sudah terhubung sempurna ke stop kontak melalui kabel power.<br /><br /><strong>Jika solusi diatas tidak berhasil, buat tiket keluhan ke halosis, sebutkan merk dan tipe perangkat.</strong> ', NULL, NULL, '2018-01-31 15:56:44', '2018-02-09 11:24:40'),
(144, 4, 0, 'Monitor pada PC redup, goyang, atau no signal', 'Solusi:<br />1. Cek kabel dari monitor ke CPU apakah sudah terpasang dengan benar.<br /><strong>Apabila solusi diatas tidak berhasil, buat tiket keluhan ke halosis, sebutkan merk dan tipe perangkat.</strong> ', NULL, NULL, '2018-02-09 10:01:56', '2018-03-01 16:31:36'),
(145, 4, 1, 'PC atau Laptop ganti Operating System', 'Solusi :<br />- Back up seluruh data.<br />- <strong>Buat tiket keluhan ke halosis, sebutkan merk dan tipe perangkat.</strong> ', NULL, NULL, '2018-02-09 10:54:36', '2018-02-09 10:54:43'),
