(157, 3, 1, 'Kondisi tinta masih banyak/penuh namun print out yang keluar hanya hitam, merek printer Xerox tipe DPC3055DX', 'Cek setting printernya.<br /> Ubah setting printer cukup dilakukan di komputer saja tidak perlu di menu mesin dengan cara:<br /> -buka menu setting printer (printer preferences), kemudian klik Paper/Output, lalu ubah setting Paper Source menjadi Auto<br /> -kemudian klik OK<br /> (bisa lihat di gambar yang dilampirkan)<br /><br />Catatan: <br />1. Untuk BPS Pusat, jika masih belum menemukan solusi atas permasalahan tersebut, <strong>b</strong><strong>uat tiket keluhan ke halosis, sebutkan merk dan tipe perangkat.</strong> <span><br />2. Untuk BPS Daerah, apabila langkah tadi belum bisa menyelesaikan masalah, bisa cek nomor call center yang berada di bagian belakang printer, kemudian telpon ke nomor tersebut untuk menanyakan alternatif penyelesaiannya. <br />Tiap wilayah (misalnya Kota atau Kabupaten) nomor call center bisa berbeda tergantung Provinsinya.<br />Namun apabila tidak dapat menemukan nomor call center tersebut, bisa meminta bantuan dengan telepon di nomor: 1500345.<br /><br /></span> ', NULL, NULL, '2018-03-14 13:16:02', '2018-03-14 14:25:28'),
(158, 3, 1, 'Muncul error \"Reboot Printer (092-310)\" merek printer Xerox tipe DPC3055DX', 'Penyebab: toner catridge tidak terletak pada posisi yang benar.<br />Solusi: matikan printer, keluarkan toner catridge kemudian masukkan kembali toner catridge ke posisi semula, nyalakan printer.<br />Untuk melihat letak posisi toner catridge pada printer, lihat gambar pada lampiran.<br /><br />Catatan: <br />1. Untuk BPS Pusat, jika masih belum menemukan solusi atas permasalahan tersebut, <strong>b</strong><strong>uat tiket keluhan ke halosis, sebutkan merk dan tipe perangkat.</strong> <br />2. Untuk BPS Daerah, apabila langkah tadi belum bisa menyelesaikan masalah, bisa cek nomor call center yang berada di bagian belakang printer, kemudian telpon ke nomor tersebut untuk menanyakan alternatif penyelesaiannya. <br />Tiap wilayah (misalnya Kota atau Kabupaten) nomor call center bisa berbeda tergantung Provinsinya.<br />Namun apabila tidak dapat menemukan nomor call center tersebut, bisa meminta bantuan dengan telepon di nomor: 1500345.', NULL, NULL, '2018-03-14 13:55:24', '2018-03-14 14:27:17'),
(159, 35, 1, 'Login aplikasi presensi online daerah', ' <p>Untuk memulai Aplikasi Presensi Online ini pengguna dapat menggunakan browser dengan mengakses ke alamat <a href=\"http://10.0.36.41/woowtime\">http://10.0.36.41/woowtime</a></p> <p>Berikut adalah tampilan awal ketika mengakses alamat tersebut:</p> <img src=\"cid:qmaprrx4vdl_-skyeo8rsblrs6gg1rou\" width=\"670\" height=\"383\" alt=\"image\" /><br /><p>Agar dapat login ke aplikasi ini dibutuhkan username dan password, secara default login untuk BPS Kabupaten/Kota :</p> <p>Username : bpsppkk</p> <p>Password : passwordppkk!</p> <p>Silahkan Masukkan username dan password diatas untuk masuk ke halaman utama aplikasi woowtime.</p> ', NULL, NULL, '2018-03-20 08:14:41', '2018-03-20 08:52:20'),
(160, 35, 1, 'Bagaimana melakukan device management', 'Pada device mangement terdapat dua bagian, yaitu device setting dan transaction monitor.<br />1. Device setting<br />Pada Device Setting beberapa hal yang umum dilakukan admin kabupaten adalah sebagai berikut:<br /><br /><ul> <li>Download</li> <li>Upload</li> </ul> Pada submenu download ini admin dapat mendownload user, log dari mesin ke dalam database aplikasi woowtime. Pengguna juga dapat mendownload attlog yang ada di mesin kedalam USB.<br /><br /> Pada submenu upload ini admin dapat mengupload user yang ada di database aplikasi woowtime ke mesin handkey yang ada di Kab/Kota. Biasanya dilakukan setelah admin mengeset pegawai sebagai admin/enroller mesin handkey. Setelah pegawai diset sebagai admin mesin handkey pada menu manage employee lakukan upload user dengan submenu ini untuk mempercepat proses sinkronisasi. <br /><br /><br /><img src=\"cid:des2x3zsgxtoqnh1pokyeanwp_fzczzg\" alt=\"image\" width=\"670\" height=\"102\" /><br />2. Transaction monitor<br /><p>Pada Transaction Monitor ini admin dapat memonitor transaksi-transaksi yang terjadi pada mesin handkey.</p> ', NULL, NULL, '2018-03-20 08:55:30', '2018-03-20 09:18:58'),
(161, 35, 1, 'Tata kelola data pegawai (Manage Employee)', 'Pada menu manage employee ini admin dapat melakukan administrasi pegawai (Entri, edit dan delete), termasuk juga untuk melakukan enroll fingerprint. Untuk menambahkan pegawai terdapat dua cara yaitu dengan entri langsung pada aplikasi woowtime atau dengan import dokumen excel. Pada pengentrian pegawai ini yang perlu diperhatikan pada entrian kolom-kolomnya adalah:<br /><br /><ul><li><strong>User ID</strong></li></ul> Untuk User ID pegawai terdapat ketentuan dari admin pusat yaitu:<br /><br /> - Untuk mitra (satpam, CS dll) memakai kode 9 digit, 4 digit pertama adalah kode daerahContoh: <br /><br /> Untuk mitra ke 9 BPS kota Semarang 337400009<br /><br />- Untuk pegawai yang pindahan dari instansi lain atau NIP lama bukan kepala 34, ID dibuat sama seperti NIP nya yang dari instansi lain tsb.Contoh:<br /><br /> Bu Sri Sarwendah NIP Lama dari instansi lain: 730008493 maka User ID nya adalah 730008493<br /><br />- Untuk pegawai BPS atau yang NIP Lama kepala 34 dibuat dari 5 digit terakhir NIP LamanyaContoh:<br /><br /> Viktor Suwiyanto NIP Lama dari BPS: 340056479 maka User IDnya: 56479<br /><br /><ul> <li> <strong>Badge Number</strong><ul> <li>Untuk mitra, isian BadgeNumber sama seperti ID.</li> <li>Untuk pegawai pindahan dari instansi lain (NIP Lama bukan berawalan 34), sama seperti ID.</li> <li>Untuk pegawai BPS (NIP Lama berawalan 34), dimasukkan NIP Lama lengkap (tanpa dipotong 5 digit terakhir).</li> </ul> </li> <li> <strong>Password</strong> harus kosong, hanya menggunakan Fingerprint (FP) untuk absen, untuk pegawai yang 10 jarinya tidak bisa dienroll karena kualitas pola sidik jarinya rendah diperbolehkan untuk menggunakan password.</li> <li> <strong>Organization dan Area ID</strong> disesuaikan dengan Kabupaten/kota masing-masing 4 digit ppkk (kode Provinsi dan kabupaten kota).</li> </ul> Entri pegawai juga dapat dilakukan dengan import file excel dengan format seperti template yang dapat di download pada submenu export. Berikut contoh isian excel yang benar.<br /><br /><img src=\"cid:xnwqaag7xcvg--oabbdjscgoodbvspzw\" alt=\"image\" /> ', NULL, NULL, '2018-03-20 09:27:10', '2018-03-20 09:28:29'),
(162, 35, 1, 'Bagaimana melakukan rooster management', 'Dalam rooster management terdapat dua tahap yng harus dilakukan, yaitu assign work dan rooster.<br /><ul><li>Assign Work Schedule</li></ul> <p>Menu ini berfungsi untuk assign shift pada pegawai, shift diperlukan untuk penghitungan terlambat dan pulang cepat serta penghitungan hari kerja.</p> <p>Untuk assign shift pegawai dapat dilakukan sekali untuk satu organisasi (satker) bisa juga diassign per pegawai. Untuk assign shift seluruh pegawai dari organisi, masuk ke menu assign work schedule, kemudian pilih organisasi kemudian tekan tombol assign shift maka akan muncul dialog.</p> <img src=\"cid:91bro40uqe94_kqwpq8c_-ydmjl6dfpy\" width=\"529\" height=\"160\" alt=\"image\" /><br /><br /><img src=\"cid:covkqb9okfmrttu3s8eqcyxmagxb62gy\" width=\"537\" height=\"439\" alt=\"image\" /><br /><p>Untuk jam kerja biasa dihari Senin sampai Kamis memakai S1 dengan jam kerja masuk 07:30 dan pulang 16:00. Untuk jumat memakai S2 dengan jam kerja masuk 07:30 dan pulang 16:30. Untuk hari Sabtu dan Minggu karena bukan hari kerja maka harus di uncheck (hilangkan checklist) working day-nya dan shiftnya dipilih OFF kemudian tekan tombol Submit. Untuk Assign shift idealnya dilakukan sebelum tanggal itu berjalan sehingga penghitungan terlambat dan pulang cepat dapat langsung diproses ketika pegawai melakukan Absen. Jika ada shift pegawai yang berbeda harap dilaporkan ke pusat untuk selanjutnya menunggu keputusan bagian administrasi kepegawaian untuk dientri di woowtime. Berikut adalah daftar shift yang telah dibuat oleh admin Pusat</p> <img src=\"cid:pzu8rfqmdxfvvaowwyggcuyfamudyahk\" width=\"670\" height=\"139\" alt=\"image\" /><br /><br /><ul><li>Roster</li></ul> <p>Menu Roster digunakan untuk pengelolaan shift, monitoring transaksi handkey per pegawai perhari, serta untuk melakukan bloking absen dengan status kehadiran (attendance status; contoh: tugas luar, perjalanan dinas dan lain-lain) dan status ketidak-hadiran (absence status; contoh: sakit, ijin,cuti tahun ini dan lain-lain).</p> <p>Sebelum melakukan fungsi-fungsi diatas admin kabupaten harus terlebih dahulu me-generate roster (matriks absen pegawai perhari) pegawai di kabupatennya. Caranya pilih organisasi, tanggal awal dan akhir roster kemudian tekan tombol Generate berikut adalah contoh hasil generate roster.</p> <img src=\"cid:rzfelxmllfnwtk1x6q09axhvrcib9w70\" width=\"670\" height=\"205\" alt=\"image\" /><br /><p>Untukmemonitoring transaksi absen per pegawai per hari pilih tab transaction log details kemudian pilih pegawai dan tanggal yang ingin dimonitoring transaksi absennya.</p> <img src=\"cid:eo3ci8lvdac54djvjjqu7u798rk_dfia\" width=\"670\" height=\"343\" alt=\"image\" /><br /><p>Untuk melakukan blok kehadiran atau ketidak hadiran misal tugas belajar (TB) dalam negeri (kehadiran) pilih pegawai dan tanggal yang ingin diset untuk status TB kemudian klik menu status, pilih status kehadiran (Attendance Status) maka akan muncul dialog.</p> <img src=\"cid:lc-wrxigewgwwwrclznml20m54ayyt-g\" width=\"470\" height=\"199\" alt=\"image\" /><br /><br /><img src=\"cid:nupauz9z_evwusdxscripvemjp63mkpw\" width=\"670\" height=\"255\" alt=\"image\" /><br /> Untuk blok ketidak-hadiran caranya sama seperti blok kehadiran hanya beda pilihan submenu status yang dipilih saja. Untuk kasus seperti harus absen manual jika terjadi masalah seperti lampu mati, dapat dilakukan entri manual dengan attandance status dengan isian: attendance status dikosongkan kemudian untuk edit time di check misal ingin mengentri manual jam masuk berarti check pada edit start time log kemudian isikan jam masuknya.<br /> ', NULL, NULL, '2018-03-20 09:37:14', '2018-03-20 09:37:21'),
(163, 35, 1, 'Bagaimana menjalankan menu prosess', ' Menu Process ini difungsikan untuk penghitungan HT dan PC untuk pegawai yang belakangan dilakukan assign shiftnya (sudah melakukan absen tapi belum diassign shiftnya kemudian diassign belakangan). Pemrosesan ini dapat dilakukan untuk satu atau lebih pegawai bisa juga untuk seluruh pegawai di kabupaten kota. Jika ingin satu atu lebih pegawai tinggal dipilih pegawainya (highlight). Cara memilih pegawai cukup klik pada pegawai yang dipilih, untuk membatalkan pemilihan pegawai cukup diklik lagi setelah selesai memilih klik tombol process employee.<br /><br /><img src=\"cid:belh8uilqrtdbi2kprzmdpffayf0pa0e\" alt=\"image\" /><br /><span><br /></span> ', NULL, NULL, '2018-03-20 09:39:05', '2018-03-20 09:39:12'),
(164, 35, 1, 'Cara mengatur agar jam di mesin sesuai dengan zona waktu masing -masing daerah', ' <p>Pengaturan zona waktu dapat dilakukan di device setting dengan cara:<br /> 1. Pastikan status mesin di device setting Online<br /> 2. double klik pada mesin yang ingin disetting zona waktunya<br /> 3. edit pada bagian kolom TZ, isian dari kolom TZ sesuai dari zona waktunya GMT+x<br /> Untuk WIB (GMT+7) isian TZ adalah 7<br /> Untuk WITA (GMT+8) isian TZ adalah 8<br /> Untuk WIT (GMT+9) isian TZ adalah 9</p> ', NULL, NULL, '2018-03-20 09:58:42', '2018-03-20 09:58:48'),
(165, 35, 1, 'Pengaturan Admin pada mesin handkey untuk presensi online', ' <p>Dikarenakan presensi online ini terkoneksi ke seluruh kabupaten/kota, untuk admin mesin handkey diharuskan dari pegawai, untuk mengeset pegawai tersebut sebagai admin mesin handkey dapat dilakukan di menu manage employee kemudian double klik pada pegawai yang ingin diset sebagai admin, setelah muncul dialog dibagian isian priviledge pilih pada pilihan admin kemudian tekan save. secara otomatis sistem akan sinkronisasi dengan mesin.</p> ', NULL, NULL, '2018-03-20 10:01:06', '2018-03-20 10:01:12'),
(166, 35, 1, 'Penandaan hari libur', ' <p>Untuk pengentrian hari libur nasional dilakukan oleh admin BPS RI, sehingga admin kab/kota tidak perlu mengentrikan, sedangkan untuk hari libur daerah seperti pilkada dan acara kedaerahan yang mengharuskan libur, bisa dilaporkan ke email sim@bps.go.id untuk dientrikan dan diberlakukan hanya untuk daerahnya.</p> ', NULL, NULL, '2018-03-20 10:02:13', '2018-03-20 10:02:19'),
(167, 35, 1, 'Penggunaan password untuk verifikasi absen presensi online', ' <p>Untuk verifikasi absen presensi online ini diharuskan memakai sidik jari / fingerprint. Pengecualian diberlakukan untuk pegawai yang 10 jarinya tidak bisa didaftarkan/enroll sidik jarinya dikarenakan kualitas hasil enroll nya rendah (Low Quality) dapat diberikan password untuk verifikasi absennya.</p> ', NULL, NULL, '2018-03-20 10:03:19', '2018-03-20 10:03:25'),
(168, 35, 1, 'Shift penjaga kantor/security atau pekerja honorer yang kerja malam', ' <p>Untuk pegawai mitra tetap seperti CS, penjaga kantor dll, mohon untuk tetap dientri di mesin handkey dan dienroll serta tetap absen sesuai jam masuk dan pulangnya masing-masing, untuk shift nanti akan ada peraturan dan SOP dari Biro Kepegawaian mengenai shift pegawai mitra tetap</p>.', NULL, NULL, '2018-03-20 10:04:49', '2018-03-20 10:04:55'),
(169, 35, 1, 'Status checkin, checkout, breakin dan breakout di mesin dengan di presensi online berbeda', 'Masih ada bug pada aplikasi presensi online, permasalahan ini sudah direkap dan dikirimkan ke vendor untuk kemudian diperbaiki aplikasinya.<br /> ', NULL, NULL, '2018-03-20 10:06:13', '2018-03-20 10:31:48'),
(170, 35, 1, 'Pegawai sudah dientri di woowtime sudah diperiksa memang sudah ada pegawainya, dan sudah dilakukan upload user (kondisi device sudah Online) tetapi status jumlah usernya masih 0, di mesin tidak ada user', 'Mohon untuk dilaporkan ke Subdit. Jaringan Komunikasi Data.', NULL, NULL, '2018-03-20 10:08:23', '2018-03-20 10:08:31'),
(171, 35, 1, 'Mengenai Pegawai pindahan yang sudah dientri di kabupaten lain', 'Untuk pegawai pindahan yang telah didaftarkan ke presensi online pada kabupaten asalnya bisa dilaporkan ke admin BPS Pusat melalui halosis@bps.go.id untuk dipindahkan datanya ke kabupaten yang baru.', NULL, NULL, '2018-03-20 10:10:38', '2018-03-20 10:19:02'),
(172, 35, 1, 'Error Duplicate ID ketika entri pegawai', 'Mohon untuk dilaporkan ke halosis@bps.go.id dengan menyertai NIP Lama serta nama pegawainya untuk dibantu memperbaiki.', NULL, NULL, '2018-03-20 10:14:40', '2018-03-20 10:19:39'),
(173, 35, 1, 'Filter organisasi dan area pada search tidak berlaku pada saat search nama pegawai, muncul semua pegawai dari daerah (kab kota) lain', 'Masih ada bug pada aplikasi presensi online, permasalahan ini sudah direkap dan dikirimkan ke vendor untuk kemudian diperbaiki aplikasinya.', NULL, NULL, '2018-03-20 10:26:40', '2018-03-20 10:26:47'),
(174, 35, 1, 'Mengapa tampilan pada rooster kosong atau putih', 'Tampilan rooster kosong biasanya hal ini terjadi karena belum membuat assign shift.<br />Tampilan rooster putih biasanya hal ini terjadi karena salah membuat assign shift.', NULL, NULL, '2018-03-20 10:31:00', '2018-03-20 10:31:07'),
(175, 35, 1, 'Fasilitas entri jam datang dan jampulang untuk solusi jika terjadi masalah tidak bisa absen karena mesin rusak dan lain-lain', ' <p>Masuk ke menu roster kemudian blok attendance untuk tanggal yang ingin dientri manual jam datang dan jam pulangnya, kemudian pilih status -&gt; attendance status muncul dialog kosongkan attendance status kemudian untuk edit jam datang atau jam pulang bisa dengan uncheck edit time log kemudian isikan jam datangnya.</p> ', NULL, NULL, '2018-03-20 11:57:39', '2018-03-20 11:57:45'),
(176, 35, 1, 'Mengapa absensi tidak muncul pada transaction log dan attendace report', 'Biasanya terjadi karena assign shift belum dibuat.<br />Langkah penyelesaian:<br />1. Buat assign shift<br />2. Buat rooster, kemudian generate<br />3. Lakukan/klik Prosess<br />4. Lakukan proses transaction log dan attendance report', NULL, NULL, '2018-03-20 14:24:30', '2018-03-20 14:24:38'),
(177, 36, 0, 'Bagaimana mengakses BackOffice dari smart-web?', 'Untuk pengguna yang sudah terdaftar di BackOffice. Silahkan membuka lampiran untuk mengakses BackOffice menggunakan smart-web.', 'BackOffice, smart-web', NULL, '2018-04-02 10:36:41', '2018-04-02 10:37:26');
